INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (1, 'University of Washington', 10, 'Seattle, WA', 'United States', 'Seattle, Washington 98195\nUnited States', 'http://www.washington.edu', 'The University of Washington is a public institution that was founded in 1861. The school\'s oldest and largest campus in terms of enrollment is located in Seattle – the largest city in Washington. In 1990, the university added two smaller campuses in Bothell and Tacoma, Washington. Around 70 percent of the university\'s students – across all three campuses – study at the undergraduate level. Still, the large university offers more than 370 graduate-level programs. Tuition costs are higher for non-Washington-state residents, and university housing is available for both undergraduate and graduate students. UW utilizes a quarter-based academic calendar, and English is the language of instruction. The university has 16 colleges and schools that offer studies in a range of subjects, such as arts and sciences, engineering and social work. Its highly ranked  include the School of Medicine, School of Nursing and the College of Education. The , a teaching hospital, is highly ranked in several specialties. The university offers a community-based medical education program that allows students to complete clinical rotations in different states throughout the region - Alaska, Idaho, Montana, Washington and Wyoming. One goal of the program is to increase the number of primary care physicians, particularly in rural areas. Research awards received by UW have topped $1 billion in recent years, and the school has more than 280 specialized research centers. Among these research centers are the West Coast Poverty Center, the Polar Science Center and the Center for Emerging and Re-emerging Infectious Diseases.', -122.3121, 47.6542, 'https://www.usnews.com/education/best-global-universities/university-of-washington-236948');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (2, 'University of Cambridge', 9, 'Cambridge', 'United Kingdom', 'Trinity Lane\nCambridge, CB2 1TN\nUnited Kingdom', 'http://www.cam.ac.uk/', 'The University of Cambridge, located around 60 miles northof London, traces its history back to 1209. Around 19,000 students​ attend theuniversity and more than 35 percent of them study at the graduate level. Thereare six schools: arts and humanities; biological sciences; clinical medicine;humanities and social sciences; physical sciences; and technology. Dozens ofacademic departments and other divisions constitute these schools. The academiccalendar at Cambridge is divided into three terms – Michaelmas (fall), Lent(winter) and Easter (spring). English is the language of instruction at theuniversity.Cambridge contains 31 residential colleges, whichare responsible for admitting undergraduate and graduate students; three colleges– Lucy Cavendish College, Murray Edwards College and Newnham College – arewomen-only. Some small-group instruction for undergraduates also takes place atthe colleges. Most undergraduate students at the University of Cambridge areguaranteed college housing for at least three years. Many new graduate studentscan also utilize college housing. Around 20 percent of the student body is fromoutside of the European Union;​ tuition costs are higher for non-EU students andvary depending on the field of study. Cambridge has more than 100 libraries,including college and department libraries. The university has around 140centers and institutes that contribute to different areas of research, such asthe Centre of African Studies; the Cambridge Centre for Economic and PublicPolicy; and the Institute of Theoretical Geophysics. In a recent year, theuniversity received around $415 million in research grants and contracts.', 0.116889, 52.206389, 'https://www.usnews.com/education/best-global-universities/university-of-cambridge-502149');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (3, 'California Institute of Technology', 6, 'Pasadena, CA', 'United States', '1200 E. California Boulevard\nPasadena, California 91125\nUnited States', 'http://www.caltech.edu', 'The California Institute of Technology, known as Caltech,was founded in 1891 as Throop University and received its current name in 1920.The science and engineering-focused school is located in Pasadena, California, roughly11 miles northeast of Los Angeles. There are roughly 2,200 students at Caltech, with around 55 percent of them studying at the graduate level. Thestudent-faculty ratio is very low, at 3:1. More than one-fourth of Caltech\'s total enrollment is international.​ The school’s academiccalendar is based on the quarter system and English is the language ofinstruction.Caltech has six academic divisions, many of which havehighly ranked graduate programs: biology and biological engineering; chemistryand chemical engineering; engineering and applied science; geology andplanetary sciences; humanities and social sciences; and physics, mathematicsand astronomy. The university guarantees housing for all first-yearundergraduate and graduate students. Instead of typical undergraduate residencehalls like those found at many U.S. universities, there are eight undergraduatehouses, each with its own government and special traditions. Newly admittedgraduate students are given priority for housing in the on-campus Catalina Apartments.Around 80 percent of undergraduates participatein research during their time at Caltech. The university offers a SummerUndergraduate Research Fellowships program where students write researchproposals, collaborate with mentors and give presentations on their projects. Caltechhas around 50 research institutes and centers, such as the ResnickSustainability Institute and the Tectonics Observatory. Additionally, theuniversity operates NASA’s Jet Propulsion Laboratory, a center for roboticexploration of the solar system that engages both faculty and students.', -118.1257, 34.1359, 'https://www.usnews.com/education/best-global-universities/california-institute-of-technology-110404');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (4, 'Columbia University', 7, 'New York, NY', 'United States', '2960 Broadway\nNew York, New York 10027\nUnited States', 'http://www.columbia.edu', 'Columbia University is a private institution that wasfounded in 1754. It is located in the Upper West Side of New York City’sManhattan borough. Originally called King’s College, the school received itscurrent name in 1896. Around 30percent of students at Columbia study at the undergraduate level and almost 30 percent of thetotal student body is international. More than 90percent of undergraduate students live on campus, and there is some university housingavailable for graduate students as well. Columbia’s academic calendar issemester-based and the language of instruction is English.The university is made up of three schools thatenroll undergraduates – Columbia College, the Fu Foundation School ofEngineering and Applied Science, and the School of General Studies – and numerousgraduate and professional schools. Among Columbia University’s highly ranked graduateprograms are the Business School, the Law School, and the College of Physicians and Surgeons. Additionally, Columbia is affiliated with for women, the UnionTheological Seminary and the Jewish Theological Seminary. The highly regarded is auniversity teaching hospital. Columbia students and faculty conduct researchacross the sciences, humanities and social sciences disciplines at more than200 university centers and institutes. Columbia has also established global centersin Amman, Jordan; Beijing; Mumbai, India; Paris; Istanbul; Nairobi, Kenya;Santiago, Chile; and Rio de Janeiro to facilitatestudy abroad and research opportunities for students.', -73.9523, 40.8109, 'https://www.usnews.com/education/best-global-universities/columbia-university-190150');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (5, 'Massachusetts Institute of Technology', 2, 'Cambridge, MA', 'United States', '77 Massachusetts Avenue\nCambridge, Massachusetts 02139\nUnited States', 'http://web.mit.edu/', 'Massachusetts Institute of Technology, founded in 1861, islocated in Cambridge, Massachusetts, near Boston. Around 11,000 students attendthe university, with roughly 60 percent of them studying at the graduate level. MITcontains five schools: architecture and planning; engineering; humanities,arts, and social sciences; management; and science. English is the language ofinstruction at MIT. The academic calendar is a 4-1-4 system with a four-week \"Independent Activities Period\" in January. During this period, undergraduateand graduate students, faculty, staff and alumni participate in forums, lectureseries, recitals and other special activities. First-year undergraduate students are the only ones required to live on campus but manystudents further along in their studies choose to reside on campus as well. Thereare many opportunities for both undergraduate and graduate students to gainresearch experience at one of MIT’s many labs or centers, including the MITNuclear Reactor Laboratory, one of the largest university research reactors inthe U.S. Nearly 90 percent of MIT undergraduates participate in the school’sUndergraduate Research Opportunities Program, which partners students andfaculty for research projects, by the time they graduate.​ More than $675 million was spent on research atMIT in a recent year, with additional federal funding going to MIT’s LincolnLaboratory, a Department of Defense research and development lab focused on technologicalsolutions to national security issues.', -71.1041, 42.3656, 'https://www.usnews.com/education/best-global-universities/massachusetts-institute-of-technology-166683');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (6, 'Harvard University', 1, 'Cambridge, MA', 'United States', 'Cambridge, Massachusetts 02138\nUnited States', 'http://www.harvard.edu/', 'Founded in 1636, Harvard University is the oldest highereducation institution in the U.S. The bulk of Harvard\'s students study at the graduate level and more than20 percent of the student body is international. Harvard is locatedin Cambridge, Massachusetts, but also has facilities such as the HarvardMedical School based in the nearby city of Boston. The university has thelargest endowment of any school in the world. Harvard research takes placeacross a range of disciplines in more than 100 centers.The university is made up of the undergraduate college, aswell as 11 other degree-granting institutions including the highly rankedBusiness School, Graduate School of Education, Law School and the John F.Kennedy School of Government. The medical school is affiliated with severalteaching hospitals, including  and . For Harvard undergraduates, the most popular majors includesocial sciences, biology/biological sciences, history, math and psychology. Theuniversity’s academic calendar is semester-based and English is the language ofinstruction. Most undergraduate students live on campus for all four years,first residing around the Harvard Yard at the center of campus as freshmen andthen in one of 12 undergraduate houses for the duration of their studies. Someuniversity housing is available for graduate students. The Harvard Library isthe largest academic library in the world, boasting around 19 million volumesat its more than 70 libraries.', -71.1244, 42.3774, 'https://www.usnews.com/education/best-global-universities/harvard-university-166027');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (7, 'Stanford University', 3, 'Stanford, CA', 'United States', 'Stanford, California 94305\nUnited States', 'http://www.stanford.edu', 'Stanford University was founded in 1885 and is located inCalifornia’s Bay Area, around 30 miles south of San Francisco. More than half of the student body studies atthe graduate level. Seven schools comprise the university, many of which arehighly ranked for graduate-level studies. Three of the schools offer both undergraduateand graduate degrees: humanities and sciences; earth sciences; and engineering.The business, law, education and medical schools offer only graduate-leveldegrees.Stanford’s academic calendar is based on aquarter system and the language of instruction is English.Around 8 percent ofthe undergraduate student body is international, as is around 30 percent of thegraduate student population.​ Housing is guaranteed for four years for undergraduateswho enter as freshmen, and more than 90 percent of undergrads live on campus.Stanford also guarantees first-year housing for new graduate students. Morethan 60 percent of graduate students live on campus, as well as around 30percent of faculty members. Stanford’s library system, which supports 20libraries, comprises more than 9.3 million physical volumes. Research fundingat Stanford has topped $1 billion, including funds from the federal government forprojects at the SLAC National Accelerator Laboratory, a U.S. Department ofEnergy lab operated by Stanford. Scientists from all over the world – around 3,400of them annually – take advantage of SLAC’s facilities. Upward of 1,000scientific papers based on research conducted at the lab are published eachyear.', -122.1647, 37.4249, 'https://www.usnews.com/education/best-global-universities/stanford-university-243744');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (8, 'Johns Hopkins University', 11, 'Baltimore, MD', 'United States', '3400 N. Charles Street\nBaltimore, Maryland 21218\nUnited States', 'http://www.jhu.edu', 'Johns Hopkins University is a private institution that was founded in 1876. The school has campuses located in and around Baltimore and the District of Columbia, as well as in Italy and China. The main campus for undergraduates is the Homewood campus in north Baltimore. Most of the university’s schools use a semester-based academic calendar, with some offering an additional, three-week study period in January. English is the language of instruction. Undergraduate students are required to live in university housing for the first two years of their studies. Accommodations are not available for graduate students, with the exception of those enrolled in the school\'s Peabody Institute, a conservatory.The university comprises nine academic divisions that offer studies in the arts and sciences, engineering, business, education, medicine, nursing, music, public health and international studies. Some of the most popular majors for undergraduates (at the Homewood campus) are public health studies, international studies and biomedical engineering. Johns Hopkins University’s  include the highly ranked School of Medicine, School of Nursing and School of Education. The , a teaching hospital, is highly ranked in many specialties. Undergraduate students can get involved in research with support from initiatives such as the Provost’s Undergraduate Research Awards program, which provides financing for students to design and conduct research with the help of a faculty sponsor. Among the institution\'s research facilities is the Johns Hopkins University Applied Physics Laboratory, an affiliated research center that is a hub for national security- and space-related research.', -76.6096, 39.3261, 'https://www.usnews.com/education/best-global-universities/johns-hopkins-university-162928');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (9, 'University of Toronto', 18, 'Toronto, Ontario', 'Canada', '315 Bloor Street W\nToronto, Ontario M5S 2J7\nCanada', 'http://www.utoronto.ca', 'The University of Toronto is a public institution that was founded in 1827. Around 80 percent of its students study at the undergraduate level. The school has three campuses – St. George, Mississauga and Scarborough – located in and around Toronto. Roughly 95 percent of the university’s graduate students study at the downtown St. George campus, as do upward of 60 percent of its undergraduates. Thousands of foreign students from more than 160 countries and regions attend the University of Toronto. In a recent year, the top countries of origin for non-Canadian students were China, India and the U.S. Tuition is higher for international students. The university comprises academic divisions focused on a range of disciplines, such as applied science and engineering, management and public health. All told, the university offers some 700 undergraduate programs and more than 200 master’s and doctoral programs. The primary language of instruction is English. The academic calendar varies between the three campuses. Student housing is available on each campus, and accommodations are guaranteed for all first-year undergraduate students. The university has more than 44 libraries that house 19 million-plus physical volumes. One major innovation that came out of the University of Toronto is insulin, which researchers discovered in the early 1920s. The university’s Banting & Best Diabetes Centre is named after two of these researchers, one of whom eventually went on to win the Nobel Prize in physiology or medicine for this work.', -79.396663, 43.663125, 'https://www.usnews.com/education/best-global-universities/university-of-toronto-499968');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (10, 'Princeton University', 8, 'Princeton, NJ', 'United States', 'Princeton, New Jersey 08544\nUnited States', 'http://www.princeton.edu', 'Princeton University was founded in 1746, making it one of the oldest higher education institutions in the U.S. The private university was originally called the College of New Jersey, but its name was changed to Princeton in 1896. The university is located in the town of Princeton, New Jersey, situated around 50 miles southwest of New York City. Some 8,000 students attend Princeton and nearly two-thirds of them study at the undergraduate level. Around 12 percent of undergraduates and more than 40 percent of graduate students at Princeton are international. Housing is guaranteed for undergraduate students for all four years, and nearly all undergraduates reside on campus. Princeton has six undergraduate residential colleges – communities that offer academic and social programs for students. A large number of graduate students, around 70 percent, also live in university housing.The Ivy League university is made up of an undergraduate college, a graduate school, the School of Architecture, the highly ranked School of Engineering and Applied Science and the Woodrow Wilson School of Public and International Affairs. Princeton undergrads can choose from more than 30 academic concentrations. The primary language of instruction is English, and the academic calendar is semester-based. Research at Princeton is conducted across four broad disciplines: engineering and applied sciences, humanities, natural sciences and social sciences. The university is affiliated with two national laboratories, the U.S. Department of Energy’s Princeton Plasma Physics Laboratory and the National Oceanic and Atmospheric Administration’s Geophysical Fluid Dynamics Laboratory. The latter lab specializes in climate research and modeling.', -74.6566, 40.3449, 'https://www.usnews.com/education/best-global-universities/princeton-university-186131');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (11, 'University of California--San Diego', 19, 'La Jolla, CA', 'United States', '9500 Gilman Drive\nLa Jolla, California 92093\nUnited States', 'http://www.ucsd.edu/', 'The University of California—San Diego is a public institution that was established in 1960. It is located in the La Jolla community of San Diego, near the Pacific Ocean. More than 75 percent of the student body studies at the undergraduate level. The school offers more than 100 undergraduate majors across a range of disciplines. UCSD undergrads are assigned to one of six residential colleges – smaller academic and social communities within the university. Incoming undergraduates and transfer students are guaranteed housing for two years. Accommodations are also available for graduate students. Out-of-state students must pay a supplemental tuition on top of the tuition in-state students pay. UCSD follows a quarter-based academic calendar, and English is the language of instruction.In addition to the six undergraduate colleges, UCSD comprises five academic divisions and five graduate and professional schools. Highly ranked UCSD  include the School of Medicine and the Jacobs School of Engineering. , a teaching hospital, is nationally ranked in a dozen adult specialties. One of the university\'s academic departments is the Scripps Institution of Oceanography, which is dedicated to ocean, earth and atmospheric science. Scripps researchers focus their efforts on subjects such as waves and circulation, global environmental monitoring and marine life. UCSD’s annual research funding has surpassed $1 billion several times in recent years. The university also operates organized research units aimed at promoting multidisciplinary research, such as the Center for Energy Research, the Kavli Institute for Brain and Mind and the San Diego Supercomputer Center.', -117.2378, 32.8771, 'https://www.usnews.com/education/best-global-universities/university-of-california-san-diego-110680');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (12, 'University of Chicago', 13, 'Chicago, IL', 'United States', '5801 S. Ellis Avenue\nChicago, Illinois 60637\nUnited States', 'http://www.uchicago.edu', 'The University of Chicago is a private institution that wasfounded in 1890. The university is located in Chicago, Illinois, in the Midwestregion of the U.S. Around40 percent of the university\'s student body studies at the undergraduate level. The university’s academic calendar is based on a quarter system and the language of instruction isEnglish. Roughly 10 percent of undergraduates and 30 percent of graduatestudents are international.​  university housing  for The university is made up of an undergraduate college andmultiple graduate divisions and professional schools. Several University ofChicago graduate schools are highly ranked, including the Booth School ofBusiness, the Law School and the Pritzker School of Medicine.', -87.6037, 41.7831, 'https://www.usnews.com/education/best-global-universities/university-of-chicago-144050');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (13, 'University of Michigan--Ann Arbor', 17, 'Ann Arbor, MI', 'United States', '500 S. State St. \nAnn Arbor, Michigan 48109\nUnited States', 'http://www.umich.edu', 'The University of Michigan—Ann Arbor is a public institution that was founded in 1817 and made the city of Ann Arbor its permanent home in 1837. The university’s campus is located just less than 45 miles west of Detroit. More than 40,000 students attend the University of Michigan—Ann Arbor, and around 65 percent of them study at the undergraduate level. The institution hosts international students from more than 110 countries. Tuition costs are higher for out-of-state students. The academic calendar is based on a trimester system at many but not all of the university’s schools. The primary language of instruction is English, but the university teaches more than 65 foreign languages. The university guarantees housing for incoming freshmen as well as offers a variety of housing options for all students.The university comprises 19 schools and colleges, including schools of business, pharmacy and social work. Some of the most popular majors for undergraduates are business, psychology and economics. Among the highly ranked  at the university are the College of Engineering, the Law School and the Stephen M. Ross School of Business. The  are highly ranked in several specialties. The university\'s research expenditures have topped $1 billion in the last several years; the discipline that receives the highest percentage of the research dollars is medical sciences. Among the many research centers at the university are the Chronic Pain and Fatigue Research Center, the Ground Robotics Research Center and the Addiction Research Center.', -83.7293, 42.282, 'https://www.usnews.com/education/best-global-universities/university-of-michigan-ann-arbor-170976');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (14, 'University of Pennsylvania', 16, 'Philadelphia, PA', 'United States', 'Philadelphia, Pennsylvania 19104\nUnited States', 'http://www.upenn.edu', 'The University of Pennsylvania, also known as Penn, was founded in 1740. The private, Ivy League institution is located in West Philadelphia, and nearly half of its full-time students study at the undergraduate level. Around 19 percent of the total student body is international, with students from more than 100 countries. In a recent year, more than 40 percent of Penn\'s international undergraduates hailed from Asia, 20 percent were from Europe and nearly 15 percent were from Canada and Mexico. The university uses a semester-based academic calendar and the language of instruction is English. First-year undergraduates are required to live on campus and may continue to do so as upperclassmen, although housing is not guaranteed after the first year. Some on-campus housing is available for graduate students as well.Penn comprises a dozen schools that focus on arts and sciences; business; communication; dental medicine; design; education; engineering and applied science; law; medicine; nursing; social policy and practice; and veterinary medicine. Four of the schools offer undergraduate degrees and all 12 have graduate offerings. The medical school is affiliated with the , which are highly ranked in several specialties. Penn’s research budget was more than $875 million in a recent year. The university’s Center for Undergraduate Research and Fellowships helps students find research projects that suit their interests, as well as funding resources. Among the university’s more than 130 research institutes and centers are the Center for Cognitive Neuroscience, the Leonard Davis Institute of Health Economics and the Penn Institute for Urban Research.', -75.2004, 39.9579, 'https://www.usnews.com/education/best-global-universities/university-of-pennsylvania-215062');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (15, 'University of California--San Francisco', 15, 'San Francisco, CA', 'United States', '500 Parnassus Ave\nSan Francisco, California 94143\nUnited States', 'http://www.ucsf.edu/', 'The University of California—San Francisco is a public institution that was founded in 1864. The health sciences-focused university has facilities throughout San Francisco and only offers graduate-level programs. The school has three main locations – the Parnassus, Mission Bay and Mount Zion campuses. In a recent year, the school enrolled more than 3,000 students. Tuition costs are higher for non-California residents, and student housing is available near the university\'s Parnassus and Mission Bay campuses.The university, which follows a quarter-based academic calendar, has four professional schools – dentistry, medicine, nursing and pharmacy – as well as a graduate division, which offers master\'s and doctoral programs, two certificate programs and a physical therapy program. A few graduate programs are offered through UCSF Global Health Sciences, an arm of the university that focuses on international health issues. The language of instruction at the university is English.The  is one of the university\'s teaching hospitals and is highly ranked in several specialties. Other medical institutions affiliated with the university include the , the UCSF Dental Center and the . UCSF receives more research funding from the National Institutes of Health than any other public school in the U.S. The university has research partnerships with companies such as Pfizer and GE Healthcare, as well as with medical institutions around the world like the Kenya Medical Research Institute and Aga Khan Health Services–Tanzania.', -122.457975, 37.763986, 'https://www.usnews.com/education/best-global-universities/university-of-california-san-francisco-110699');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (16, 'University of California--Los Angeles', 14, 'Los Angeles, CA', 'United States', '405 Hilgard Avenue\nLos Angeles, California 90095\nUnited States', 'http://www.ucla.edu/', 'The University of California—Los Angeles, commonly referredto as UCLA, is a public institution that was founded in 1919. It is one of themost applied-to universities in the U.S. Around 70 percent of the university\'s student body studies at the undergraduate level, and roughly 12 percent of undergraduates and more than 20 percent of graduate students atUCLA are international. Students who are not California residents must pay a supplemental tuition. UCLA guarantees three years of housing to freshmanundergraduates, and some university housing is available for graduate studentsas well.Undergraduate studies take place across fiveacademic divisions at UCLA: letters and science; arts and architecture;engineering and applied science; nursing; and theater, film and television. Someof the most popular majors for undergraduate students are political science, businesseconomics and biology. Among the university’s highly ranked graduate schoolsare the Anderson School of Management, the David Geffen School ofMedicineHenry Samueli Schoolof Engineering and Applied ScienceThe, the university’s primary teaching hospital, isa highly regarded medical facility. Most of the university’s schools use a quarter-based academic calendar, and English is the language of instruction. Since 2009-2010, the university has received anaverage of $1 billion for research each year. UCLA has more than 350 research labs,centers and institutes, and nearly 300 of these facilities are dedicated tomedical research. Undergraduates can assist faculty with research at UCLA – andearn academic credit – by participating in the Student Research Program.', -118.4448, 34.0689, 'https://www.usnews.com/education/best-global-universities/university-of-california-los-angeles-110662');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (17, 'Yale University', 12, 'New Haven, CT', 'United States', 'New Haven, Connecticut 06520\nUnited States', 'http://www.yale.edu/', 'Yale University was founded in 1701, making it one of the oldest institutions of higher education in the U.S. The private university is located in New Haven, Connecticut, around 80 miles northeast of New York City. Roughly 45 percent of Yale students study at the undergraduate level. Around 20 percent of the total student body is international, with students hailing from more than 110 countries. The university uses a semester-based academic calendar, and the primary language of instruction is English. More than 80 percent of undergraduates live in university housing, and accommodations are available for graduate students as well.The university comprises the undergraduate college, the Graduate School of Arts and Sciences and numerous professional schools. Economics, political science and history are among the most popular majors for undergraduates. Among Yale\'s  highly ranked  are the Law School and the School of Management. The medical school is affiliated with the , which is highly ranked in several specialties. The university has many research centers and institutes, among them the Yale Center for Emotional Intelligence, the Yale Cancer Center and the Yale Program in Sleep. Undergraduates have lots of opportunities to get involved with research at the university. For example, students can apply for a Yale College Freshman Summer Research Fellowship in the Sciences & Engineering. One of the major research innovations associated with Yale is chemotherapy treatment, which was developed at the university in the early 1940s.', -72.9281, 41.3099, 'https://www.usnews.com/education/best-global-universities/yale-university-130794');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (18, 'Imperial College London', 20, 'London', 'United Kingdom', 'Exhibition Road\nLondon, SW7 2AZ\nUnited Kingdom', 'http://www3.imperial.ac.uk/', 'Imperial College London is a public institution that was founded in 1907. The university was previously a college of the University of London and became an independent institution in 2007. The science-focused university is made up of multiple campuses located in and around London. The main campus is situated in South Kensington, an area in Central London that is home to other cultural and educational institutions, such as the Natural History Museum. Upward of 15,000 students attend Imperial, and tuition costs are higher for non-European Union students. Housing is guaranteed for first-year undergraduates, and a limited number of rooms are available for returning undergrads. On-campus graduate student housing is available for those studying at the Silwood Park campus, located around 25 miles west of Central London.The university comprises four academic divisions focused on engineering, medicine, natural sciences and business. Imperial\'s academic calendar contains three terms – autumn, spring and summer – and the primary language of instruction is English. Among the university’s research centers and groups are the Data Science Institute, the Institute of Global Health Innovation and the Centre for Hedge Fund Research. The university’s Undergraduate Research Opportunities Programme each year provides around 400 students with hands-on research opportunities. The university\'s International Research Opportunities Programme sends Imperial undergraduates to partner universities in different countries – such as the  in the U.S. and  in South Korea – to conduct research for a minimum of eight weeks during the summer break. Imperial also has a history of research pioneers, including Alexander Fleming, who in 1945 discovered penicillin, an antibiotic that is now commonly used to treat bacterial infections.', -0.174202, 51.498598, 'https://www.usnews.com/education/best-global-universities/imperial-college-london-505571');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (19, 'Northwestern University', 24, 'Evanston, IL', 'United States', '633 Clark Street\nEvanston, Illinois 60208\nUnited States', 'http://www.northwestern.edu', 'Northwestern University is a private institution that was founded in 1851. The university has three campuses – the main one in Evanston, Illinois; one in nearby Chicago; and one in Doha, Qatar. The city of Evanston is located around 14 miles north of Chicago, on the shore of Lake Michigan. Tuition is the same for domestic and international students, and international undergraduate applicants are permitted to apply for need-based aid from Northwestern. International graduate students pursuing Master of Fine Arts and doctoral degrees can also receive institutional aid. University housing is available for both undergraduate and graduate students, and almost 70 percent of the undergraduate student body lives on campus.The university has a dozen schools and colleges: arts and sciences; communication; education and social policy; engineering and applied science; journalism, media and integrated marketing communications; law; management; medicine; music; professional studies; a graduate school; and Northwestern University in Qatar. Northwestern follows a quarter-based academic calendar, and the primary language of instruction is English. A sampling of the university\'s many research centers includes the Northwestern University/Art Institute of Chicago Center for Scientific Studies in the Arts, the Center for Cancer Nanotechnology Excellence and the Northwestern Center for Water Research. In a recent year, the university earned more than $650 million in sponsored research awards. The institution\'s Office of Undergraduate Research helps students take advantage of various research opportunities, such as the Summer Undergraduate Research Grants program, which supports students for eight weeks of full-time summer work under faculty supervision.', -87.6772, 42.0537, 'https://www.usnews.com/education/best-global-universities/northwestern-university-147767');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (20, 'New York University', 28, 'New York, NY', 'United States', '70 Washington Square S\nNew York, New York 10012\nUnited States', 'http://www.nyu.edu', 'New York University, also known as NYU, is a private university that was founded in 1831. The university\'s main campus is in New York City, and it has additional campuses in Abu Dhabi, United Arab Emirates, and Shanghai, which opened in 2010 and 2013, respectively. In a recent year, around one-quarter of the NYU student body was international, with students hailing from more than 130 countries. For several years, NYU has welcomed more international students to campus than any other U.S. university. Tuition costs are the same for domestic and international students, and university housing is available for both undergraduate and graduate students.NYU has 18 schools and colleges that offer studies in a variety of fields, including arts and sciences, business, engineering, law, nursing and more. The university follows a semester-based academic calendar with a three-week January term. The primary language of instruction is English. NYU has 11 academic centers located around the world – including sites in Berlin; Buenos Aires, ; and Tel Aviv,  – that are home to NYU students who are studying abroad. A sampling of the university\'s many research institutes and centers includes the Brennan Center for Justice, the Sleep Disorder Center and the Vincent C. Ross Institute of Accounting Research. Students at the undergraduate level are included in research activities at NYU through such programs as the Dean\'s Undergraduate Research Fund, which awards grants to students pursuing research projects.', -73.9983, 40.7257, 'https://www.usnews.com/education/best-global-universities/new-york-university-193900');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (21, 'University College London', 21, 'London', 'United Kingdom', 'Gower Street\nLondon, WC1E 6BT\nUnited Kingdom', 'http://www.ucl.ac.uk/', 'University College London, or UCL, is a public institution that was founded in 1826. It was the third university established in England, following the  and the . UCL is based in central London, though it also has branch campuses in Qatar and Australia. Additionally, UCL has exchange and research agreements as well as other types of partnerships with universities around the world, such as the  in Canada and  in China. UCL students hail from around 150 countries, and tuition costs are higher for students from outside the U.K. and European Union. University housing is guaranteed for first-year undergraduates. The UCL academic calendar has three terms, and the language of instruction is English. UCL has 11 academic divisions: arts and humanities; brain sciences; engineering; education; laws; life sciences; mathematical and physical sciences; medical sciences; population health sciences; social and historical sciences; and the Bartlett, a division focused on architecture and planning. The university is affiliated with several hospitals and medical centers, such as the University College Hospital and the Royal National Throat, Nose and Ear Hospital. Research takes place across the academic disciplines at UCL, but the main multidisciplinary research domains are neuroscience, personalized medicine, populations and lifelong health, the environment and eResearch. The university has been associated with research accomplishments throughout its history. One example is that a UCL professor won the Nobel Prize in chemistry in 1904 for his discovery of noble gases, including neon gas.', -0.135568, 51.525599, 'https://www.usnews.com/education/best-global-universities/university-college-london-501693');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (22, 'Swiss Federal Institute of Technology Zurich', 25, 'Zurich', 'Switzerland', 'Rämistrasse 101\nZurich, CH-8092\nSwitzerland', 'https://www.ethz.ch/en.html', '', 8.548106, 47.376178, 'https://www.usnews.com/education/best-global-universities/swiss-federal-institute-of-technology-zurich-502241');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (23, 'University of Sydney', 27, 'Sydney, New South Wales', 'Australia', 'Sydney, New South Wales 2006\nAustralia', 'http://sydney.edu.au/ ', 'The University of Sydney was founded in 1850, making it the oldest university in Australia. The public institution is located in Sydney in the southeastern Australian state of New South Wales. In addition to its main location – the Camperdown/Darlington campus – near the city\'s central business district, the university has other campuses and research facilities in Sydney and other areas of Australia. One of the additional sites is the One Tree Island Research Station located near the Great Barrier Reef, which facilitates research on topics such as climate change and geology. Student accommodations are available at several of the university\'s campuses. On the Camperdown/Darlington campus, students can live in residential colleges – including the International House – or university-managed apartments and dorms. Tuition costs vary by subject and are higher for international students.The university has 16 academic divisions, including agriculture and environment, arts and social sciences, business, engineering and information technologies, and medicine. English is the language of instruction, and the university’s academic calendar is semester-based. Undergraduate students have the option of applying to the university\'s one-year, research-focused honors program. Some of the University of Sydney’s more than 70 research centers are the Brain and Mind Centre, the China Studies Centre and the Centre for Carbon, Water and Food. The school has student exchange agreements with roughly 300 universities located all over the world, including the  in Canada,  in China and  in Sweden.', 151.187347, -33.888584, 'https://www.usnews.com/education/best-global-universities/university-of-sydney-505369');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (24, 'University of British Columbia', 30, 'Vancouver, British Columbia', 'Canada', '1200-1874 E. Mall\nVancouver, British Columbia V6T 1Z4\nCanada', 'http://you.ubc.ca/', 'The University of British Columbia is a public institution located in the Canadian province of British Columbia. The university was established in 1908 and opened in 1915. It has two main campuses – the Vancouver campus and the Okanagan campus located in Kelowna. The Vancouver campus is the larger of the two, accommodating more than 85 percent of UBC students. In a recent year, 23 percent of students at the Vancouver campus and around 13 percent at the Okanagan campus were international. Tuition costs at UBC vary by degree program and are higher for international students. University housing is guaranteed for first-year UBC undergraduates, and newly admitted international students who are second-year undergrads receive housing priority too. Housing is also available for returning undergraduate and graduate students. The Vancouver campus offers more than two dozen academic divisions, while the Okanagan campus has eight. The academic calendars for both campuses include two-term winter and summer sessions, although the summer session is optional. The primary language of instruction at UBC is English. First-year international students can opt to enroll in the Vantage One program at UBC\'s Vantage College, which aims to help students improve their English, in part by stretching their first year of study from eight to 11 months. Following completion, students transition into the second year of their UBC degree program. Examples of UBC research facilities include Canada’s national TRIUMF subatomic physics laboratory, the Centre for Sustainable Food Systems at UBC Farm and the Institute for Healthy Living and Chronic Disease Prevention.', -123.245989, 49.260805, 'https://www.usnews.com/education/best-global-universities/university-of-british-columbia-499976');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (25, 'Duke University', 22, 'Durham, NC', 'United States', 'Durham, North Carolina 27708\nUnited States', 'http://www.duke.edu/', 'Duke University traces its roots back to 1838, though the private institution didn’t receive its current name until 1924. Duke’s main location is made up of three contiguous campuses (called East, West and Central) located in Durham, North Carolina. Around 15,000 students attend the university, and more than half of them study at the graduate level. English is the language of instruction. Around 10 percent of undergraduates and nearly a quarter of graduate students are international. Undergraduates are required to live on campus for three years and can also choose to do so during their senior year. On-campus housing is not available for graduate students.Duke comprises 10 schools and colleges: arts and sciences, law, medicine, nursing, engineering, business, public policy, environment, the divinity school and the graduate school. Some of the most popular undergraduate majors are biology, economics and public policy. Most of the schools at the university use a semester-based academic calendar. Among Duke’s highly ranked  are the Fuqua School of Business, School of Medicine and the School of Nursing. Duke University Hospital, a teaching hospital, is highly ranked in many specialties. In a recent year, Duke spent more than $1 billion on research, which is organized and conducted across the university at institutes such as the Duke Institute for Brain Sciences, the Duke Global Health Institute and the Duke Population Research Institute. Internationally, Duke has partnered with  to create Duke Kunshan University in China – which offers graduate degrees and semesterlong programs for undergrads – and with the  to create the Duke-NUS Graduate Medical School in Singapore.', -78.9398, 36.0009, 'https://www.usnews.com/education/best-global-universities/duke-university-198419');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (26, 'University of Edinburgh', 28, 'Edinburgh, Scotland', 'United Kingdom', 'Old College, South Bridge\nEdinburgh, Scotland EH8 9YL\nUnited Kingdom', 'http://www.ed.ac.uk/home', 'The University of Edinburgh is a public institution that was founded in 1583. It is spread across five campuses in Edinburgh, Scotland – the capital and one of the country\'s largest cities. The university\'s Central Area Campus contains the main administrative buildings and library as well as humanities and social science facilities. The other sites are the King’s Buildings, Easter Bush, Little France and Western General Hospital campuses. Tuition costs are higher for students from outside Scotland and the European Union.The university has three colleges – arts, humanities and social science; medicine and veterinary medicine; and science and engineering –  with a combined total of 20 schools. The university’s academic calendar is semester-based, and the primary language of instruction is English. Students can enroll in free six-week introductory Gaelic classes to get a taste of Scotland\'s historical language. First-year undergraduate students who are from outside Edinburgh are guaranteed housing. Graduate student accommodations are also available and are guaranteed for new graduate students from outside the EU. One notable research achievement associated with the university is the first cloning of a mammal from an adult somatic cell. Dolly, a sheep, was cloned at the University of Edinburgh’s Roslin Institute in 1996. Some of the university\'s other research centers and institutes include the Centre on Constitutional Change, the MRC Institute of Genetics and Molecular Medicine and the UK Centre for Astrobiology.', -3.186517, 55.947432, 'https://www.usnews.com/education/best-global-universities/university-of-edinburgh-505832');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (27, 'Cornell University', 23, 'Ithaca, NY', 'United States', 'Ithaca, New York 14853\nUnited States', 'http://www.cornell.edu', 'Cornell University is a private institution that was founded in 1865. The Ivy League school is located in Ithaca, New York, which is about 220 miles northwest of New York City. In a recent year, Cornell enrolled more than 21,000 students, about 65 percent of whom were studying at the undergraduate level. The same year, around 20 percent of the total student body was international. Domestic and international students pay the same tuition at Cornell, and various types of university student housing are offered, including themed residence halls as well as apartments for graduate and professional students.The university has 14 colleges and schools, including seven undergraduate divisions in addition to graduate and professional divisions located in Ithaca, New York City and Doha, Qatar. The undergraduate colleges offer studies in agriculture and life sciences; architecture, art and planning; arts and sciences; business; engineering; human ecology; and industrial and labor relations. The university follows a semester-based academic calendar, and English is the language of instruction. Cornell offers English language courses and other resources, such as a language partner program, for international students. Research opportunities are available for both undergraduate and graduate Cornell students. One such offering that undergrads can take advantage of is the Food Science Summer Scholar Program, a 10-week program that provides students with stipends. A sampling of the university\'s research centers includes the Cornell Center for Comparative and Population Genomics, the Center for the Study of Inequality and the Center for Advanced Computing.', -76.4842, 42.4463, 'https://www.usnews.com/education/best-global-universities/cornell-university-190415');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (28, 'University of Melbourne', 26, 'Parkville, Victoria', 'Australia', '1-100 Grattan St\nParkville, Victoria 3010\nAustralia', 'http://www.unimelb.edu.au/ ', 'The University of Melbourne is a public institution that was founded in 1853. The university has seven campuses located across Melbourne and other areas of Victoria, Australia. The school\'s main site is the Parkville campus, and both undergraduate and graduate students can reside in one of several nearby residential colleges. Other sites are the Southbank, Burnley, Creswick, Dookie, Shepparton and Werribee campuses. Tuition costs at the University of Melbourne vary by subject and are higher for international students. Dentistry, veterinary science and medicine are among the university\'s more expensive programs.Undergraduate students at the University of Melbourne choose from several bachelor\'s degree options: agriculture, arts, biomedicine, commerce, design, environments, fine arts, music, oral health and science. They then choose more specific majors within these broad degree categories. Extended Bachelor of Arts and Bachelor of Science programs are also available for indigenous students. The University of Melbourne also has nearly 20 graduate schools, including the Melbourne Business School, the Melbourne Medical School and the Melbourne Conservatorium of Music. The university has five Melbourne Research Institutes that encourage collaboration between university researchers, as well as involvement from industry, government and nonprofit organizations. The institutes focus on neuroscience, sustainable society, networked society, energy and social equity. One research achievement associated with the University of Melbourne came in the 1970s, when researchers developed the cochlear implant, an electronic device used to restore a sense of sound to people with severe hearing loss.', 144.961752, -37.800176, 'https://www.usnews.com/education/best-global-universities/university-of-melbourne-501796');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (29, 'University of California--Berkeley', 4, 'Berkeley, CA', 'United States', '110 Sproul Hall\nBerkeley, California 94720-5800\nUnited States', 'http://berkeley.edu/', 'The University of California—Berkeley is situated roughly 15 miles from San Francisco in what is known as the Bay Area. The public university, also commonly known as Berkeley or Cal, was founded in 1868. More than 70 percent of Berkeley students study at the undergraduate level. The university is divided into 14 colleges and schools, including the highly ranked Haas School of Business, College of Chemistry, College of Engineering, School of Public Health and School of Law. The academic calendar is semester-based and English is the language of instruction.UC—Berkeley offers students around 350 degree programs. Some of the most popular majors for Berkeley undergraduates have included electrical engineering and computer science; economics; political science; business administration; and psychology. Around a quarter of undergraduatestudents live on campus, including some 95 percent of freshmen. Many graduatestudents live off campus, but they have the option to live in university-ownedaccommodations. Roughly 15 percent of the student body is international, andtuition and fees are higher for out-of-state students. Around 3,000international scholars come to Berkeley each year in temporary teaching orresearch positions. Berkeley research is conducted not just within academicdepartment labs and research centers but also in some of the school’s museumsand university-managed biological field stations. Research in botany, zoology,ecosystems and forestry is undertaken at the remote field station sites.Berkeley researchers discovered several of the elements on the periodic table, includingcalifornium and berkelium.', -122.2618, 37.8686, 'https://www.usnews.com/education/best-global-universities/university-of-california-berkeley-110635');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (30, 'University of Copenhagen', 32, 'Copenhagen', 'Denmark', 'Nørregade 10\nCopenhagen, 1165\nDenmark', 'http://www.ku.dk/english/ ', '', 12.571396, 55.680364, 'https://www.usnews.com/education/best-global-universities/university-of-copenhagen-503710');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (31, 'King\'s College London', 37, 'London', 'United Kingdom', 'Strand\nLondon, WC2R 2LS\nUnited Kingdom', 'http://www.kcl.ac.uk/index.aspx', '', -0.115794, 51.51201, 'https://www.usnews.com/education/best-global-universities/kings-college-london-500330');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (32, 'University of Amsterdam', 40, 'Amsterdam', 'Netherlands', 'Spui 21\nAmsterdam, 1012 WX\nNetherlands', 'http://www.uva.nl/en/home', 'The University of Amsterdam is a public institution that traces its roots back to 1632. The university is spread across four campuses in the Netherlands – the City Centre Campus, the Roeterseiland Campus, the Amsterdam Science Park and the Academic Medical Center. In a recent year, more than 30,000 students attend the university. Tuition fees at the Dutch institution are higher for students from non-European Union and non-European Economic Area countries, with the exception of Swiss and Surinamese students. The university reserves a number of rooms for international students in residences that outside housing organizations manage.The university has seven academic divisions: dentistry, economics and business, humanities, law, medicine, science, and social and behavioral sciences. The school\'s academic calendar is semester-based. The primary language of instruction for bachelor’s programs is Dutch, though several English-taught programs are available. Many master\'s programs are taught in English. Around one-fourth of the University of Amsterdam\'s research is conducted in one of the institution’s 20 research priority areas, which include infection and immunity, behavioral economics, and private and public European law. Some of the university’s research institutes include the Amsterdam Institute for Advanced Labour Studies, the Institute for Biodiversity and Ecosystem Dynamics and the Anton Pannekoek Institute for Astronomy. The university also manages two institutes – one in Athens, , and the other in Saint Petersburg,  – that are members of the Dutch Scientific Institutes Abroad network. The institutes support Dutch staff and students who conduct research overseas.', 4.890187, 52.368622, 'https://www.usnews.com/education/best-global-universities/university-of-amsterdam-502957');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (33, 'University of North Carolina--Chapel Hill', 33, 'Chapel Hill, NC', 'United States', 'Chapel Hill, North Carolina 27599\nUnited States', 'http://www.unc.edu', '', -79.0509, 35.9043, 'https://www.usnews.com/education/best-global-universities/university-of-north-carolina-chapel-hill-199120');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (34, 'Sorbonne Universite', 37, 'Paris', 'France', '21, rue de l\'Ecole-de-medecine\nParis, 75006\nFrance', 'https://www.sorbonne-universite.fr/en/university', '', 2, 49, 'https://www.usnews.com/education/best-global-universities/sorbonne-universite-529569');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (35, 'Washington University in St. Louis', 31, 'St. Louis, MO', 'United States', '1 Brookings Drive\nSt. Louis, Missouri 63130\nUnited States', 'http://www.wustl.edu', 'Washington University in St. Louis, also known as Wash U, is a private institution that was founded in 1853. The Missouri-based school has two main sites – the Danforth and Medical Campuses. The campuses are located near each other, separated by Forest Park. In a recent year, more than 12,000 full-time students were enrolled at the university, and members of the university\'s international student body hailed from more than 80 countries. The primary language of instruction at Wash U is English, and English language courses and other support programs are available for international students. Tuition is the same for domestic and international students, and university housing is available.The university has academic divisions that offer studies in a variety of fields: art and architecture, arts and sciences, business, engineering, law, medicine, and social work and public health. Wash U is affiliated with several hospitals, including the  and the , both of which are ranked in a number of specialties. The university focuses its research on the areas of medicine, environment and energy, innovation and entrepreneurship, and plant science, and researchers carry out more than 3,000 projects at Wash U each year. Undergraduates can get involved in research at the university and can receive guidance and financial support from the Office of Undergraduate Research. A sampling of the university\'s research centers includes the Weidenbaum Center on the Economy, Government and Public Policy, the Genome Institute and the McDonnell Center for the Space Sciences.', -90.3216, 38.6635, 'https://www.usnews.com/education/best-global-universities/washington-university-in-st-louis-179867');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (36, 'National University of Singapore', 34, NULL, 'Singapore', '21 Lower Kent Ridge Road\n119077\nSingapore', 'http://www.nus.edu.sg/', '', 103.776394, 1.296643, 'https://www.usnews.com/education/best-global-universities/national-university-of-singapore-505009');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (37, 'Tsinghua University', 36, 'Beijing', 'China', 'Beijing, 100084\nChina', 'http://www.tsinghua.edu.cn/publish/newthuen/ ', 'Tsinghua University, located in northwest Beijing, China, is a public institution that traces its roots back to 1911. The primary language of instruction is Chinese, though there are some graduate degree programs offered in English. For instance, the university has English-taught master\'s programs in Chinese politics, foreign policy and international relations; mechanical engineering; and global business journalism, among others.Tuition costs vary by degree program and language of instruction. The university\'s international students hail from more than 100 countries, with the bulk of them coming from Asia. In a recent year, 41 percent of the university\'s non-Chinese students were undergraduates, 29 percent were pursuing master\'s degrees, 9 percent were doctoral students and the rest were participating in shorter-term programs. Tsinghua University housing is available for both undergraduate and graduate students.The university comprises numerous schools and departments, which offer programs across a variety of disciplines: science, engineering, literature, arts, history, philosophy, economics, management, law, education and medicine. In all, there are more than 70 degree programs available to undergraduate students at Tsinghua University, as well as many more master\'s and doctoral programs. The university has more than 300 research institutions. Among the university\'s research labs are the Tsinghua National Laboratory for Information Science and Technology, the State Key Laboratory of Precision Measuring Technology and Instruments and the National Engineering Laboratory for Digital Television. Students at Tsinghua have around 200 student groups that they can get involved in, such as the Zijing Volunteer Service and the Students\' Performing Arts Club.', 116.326444, 39.999667, 'https://www.usnews.com/education/best-global-universities/tsinghua-university-503146');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (38, 'University of California--Santa Barbara', 41, 'Santa Barbara, CA', 'United States', 'Santa Barbara, California 93106\nUnited States', 'http://www.ucsb.edu', 'The University of California—Santa Barbara, or UCSB, is a public university that traces its roots back to 1891. The school became part of the University of California system in 1944. The West Coast university\'s campus overlooks the Pacific Ocean and is about 100 miles northwest of Los Angeles. In a recent year, the institution enrolled more than 20,000 students, and upward of 85 percent of them were studying at the undergraduate level. Top countries of origin for UCSB\'s international students that year included China, India and South Korea. Non-California residents pay a supplemental tuition at UCSB. University housing is available and guaranteed for four years for new freshmen undergrads and for two years for transfer students.UCSB has five colleges and schools – creative studies, engineering, letters and science, environmental science and management, and education – as well as a graduate division. In all, the institution offers more than 200 majors, degrees and credentials. The university follows a quarter-based academic calendar, and English is the primary language of instruction. UCSB has around a dozen national research institutes and centers on its campus, including the Kavli Institute for Theoretical Physics, the Materials Research Laboratory and the Institute for Collaborative Biotechnologies, which the U.S. Army supports. More than 50 percent of the university\'s undergraduate students conduct research, some through programs such as the Faculty Research Assistance Program, which pairs students with UCSB researchers in their fields of interest and allows them to earn credit for their work.', -119.8461, 34.4173, 'https://www.usnews.com/education/best-global-universities/university-of-california-santa-barbara-110705');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (39, 'University of Wisconsin--Madison', 37, 'Madison, WI', 'United States', '500 Lincoln Drive\nMadison, Wisconsin 53706\nUnited States', 'http://www.wisc.edu', 'The University of Wisconsin—Madison, founded in 1848, is a public university located in the U.S. Midwest. Madison is the capital of Wisconsin, a state located near the Great Lakes and not far from the U.S.-Canadian border. More than 40,000 students attend the university, and in a recent year more than 65 percent of the student body was studying at the undergraduate level. International students at the university hail from more than 100 countries. Tuition costs at the University of Wisconsin—Madison are higher for non-Wisconsin residents, though Minnesota residents also pay a lower rate. University housing is available for both undergraduate and graduate students. Housing options include residence halls that vary in size from around 30 to more than 1,100 residents.The university has a number of schools and colleges, including those focused on agricultural and life sciences, arts, business, education, engineering, journalism and mass communication, medicine and public health, public affairs and more. In all, the university offers more than 200 undergraduate majors and certificates and upward of 250 graduate programs. The language of instruction is English, and the university follows a semester-based academic calendar. The University of Wisconsin—Madison spends more than $1 billion on research annually. A sampling of the university\'s research centers includes the Aquatic Sciences Center, the Institute on Aging and the Stem Cell & Regenerative Medicine Center. A total of 19 Nobel Prizes have been awarded to university faculty and alumni.', -89.4082, 43.0748, 'https://www.usnews.com/education/best-global-universities/university-of-wisconsin-madison-240444');
