INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (43, 'École Polytechnique Federale of Lausanne', 45, 'Lausanne', 'Switzerland', 'Route Cantonale\nLausanne, CH-1015\nSwitzerland', 'http://www.epfl.ch/', '', 6.566767, 46.518342, 'https://www.usnews.com/education/best-global-universities/ecole-polytechnique-federale-of-lausanne-501629');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (44, 'University of Queensland Australia', 42, 'Brisbane, Queensland', 'Australia', 'Brisbane, Queensland 4072\nAustralia', 'http://www.uq.edu.au/ ', 'The University of Queensland Australia is a public institution that was established in 1909. It is located in and around Brisbane, Australia, the capital of Queensland. The university has three main campuses: the St Lucia campus, where the large majority of students study; the Gatton campus, the university’s hub for agriculture and veterinary science; and the Herston campus, which houses the school’s clinical health facilities. Other University of Queensland sites – including marine research stations, teaching hospitals and an underground mine – are located around Queensland. Tuition costs vary by subject and are higher for international students. University student housing is available at both the St Lucia and Gatton campuses.The university has six main academic divisions: business, economics and law; engineering, architecture and information technology; health and behavioral sciences; humanities and social sciences; medicine and biomedical sciences; and science. English is the language of instruction at the University of Queensland, and the university follows a semester-based academic calendar. Some courses are also offered during a shorter summer semester. As is the case at many , bachelor’s students can earn an honors degree by completing an additional year or two of study, focused heavily on research. The university’s research facilities include the Institute for Molecular Bioscience, the Queensland Brain Institute and the Australian Institute for Bioengineering and Nanotechnology. Undergraduate students can receive scholarships to participate in research during summer and winter breaks via university research programs.', 153.01203, -27.495431, 'https://www.usnews.com/education/best-global-universities/university-of-queensland-australia-500164');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (45, 'McGill University', 49, 'Montréal, Québec', 'Canada', '845 Sherbrooke Street W\nMontréal, Québec H3A 0G4\nCanada', 'http://www.mcgill.ca/', 'McGill University is a public institution that was founded in 1821 and is located in Quebec, Canada. The university has two campuses: the downtown campus in Montreal and the Macdonald campus in Sainte-Anne-de-Bellevue. The two campuses are approximately 20 miles apart. The primary language of instruction is English, although in a recent year around 20 percent of university students said French was their mother tongue. In fact, around half of the population of Montreal speaks French as a first language. Around one-fourth of the student body is international, with students hailing from more than 150 countries. University housing is available for undergraduate and graduate students on both campuses.The university is made up of 10 faculties and schools – agricultural and environmental sciences, arts, dentistry, education, engineering, law, management, medicine, music and science – that offer around 300 programs of study. Around two-thirds of the university\'s students study at the undergraduate level. Tuition costs are higher for international students, and McGill\'s academic calendar is based on a semester system. The university is affiliated with multiple teaching hospitals, and its medical school is the oldest in Canada. Research at the university takes place at more than 40 McGill research centers – such as the McGill Centre for Bioinformatics, the Centre on Population Dynamics and the Centre for Intellectual Property Policy – and at other affiliated institutes and hospitals. The creation of the first artificial blood cell is among the research achievements associated with the university.', -73.577175, 45.505003, 'https://www.usnews.com/education/best-global-universities/mcgill-university-499986');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (46, 'University of Munich', 43, 'Munich', 'Germany', 'Geschwister-Scholl-Platz\nMunich, 80539\nGermany', 'http://www.en.uni-muenchen.de/index.html ', 'The University of Munich is a public institution that traces its roots back to 1472. It is situated in Munich – the capital of Bavaria and one of the largest cities in Germany. The university\'s downtown campus is home to the social science and humanities disciplines, while its “HighTechCampus” in the southeast part of the city is home to the natural and life sciences. In a recent year, just more than half of the university\'s students were studying at the undergraduate level. Students at LMU Munich, as the university is sometimes called, generally do not pay tuition. However, some of the school\'s English-taught degree programs charge tuition. A limited amount of student housing is available through Studentenwerk München, or the Munich Student Union, a public organization.In all, the university has 18 academic divisions, including faculties of business administration, medicine and social sciences and offers more than 200 degree programs. The primary language of instruction at the University of Munich is German. However, the institution does offer some English-taught master’s degree programs, including programs in economics, neuro-cognitive psychology and software engineering. The university\'s academic calendar is semester-based, with classes beginning in October and April. The University of Munich has around 50 research centers, such as the Center for Neuropathology, the Center for Quantitative Risk Analysis and the Munich Center for Ethics. The university also boasts more than a dozen external partner research institutes, including the Bavarian Academy of Fine Arts and the Institute of Law for Lawyers.', 11.580943, 48.150163, 'https://www.usnews.com/education/best-global-universities/university-of-munich-500951');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (47, 'University of Minnesota--Twin Cities', 47, 'Minneapolis, MN', 'United States', '100 Church Street SE\nMinneapolis, Minnesota 55455-0213\nUnited States', 'http://www.umn.edu', '', -93.235, 44.9731, 'https://www.usnews.com/education/best-global-universities/university-of-minnesota-twin-cities-174066');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (48, 'Heidelberg University', 56, 'Heidelberg', 'Germany', 'Grabengasse 1\nHeidelberg, 69117\nGermany', 'http://www.uni-heidelberg.de/index_e.html ', 'Heidelberg University is a public institution that was founded in 1386, earning it the title of Germany\'s oldest university. The school is located in Heidelberg in the state of Baden-Württemberg and is spread across three campuses. Just less than 20 percent of the total student body is international. The university does not charge students for tuition – this is generally the case with public universities in Germany. Students instead pay relatively low semester fees. Some student housing is available through Studierendenwerk, a public organization that provides accommodations and other services to university students.The university has a dozen academic divisions: theology, law, philosophy, modern languages, economics and social sciences, behavioral and cultural studies, math and computer science, chemistry and earth sciences, physics and astronomy, biosciences and two medical faculties. The school\'s academic calendar is semester-based, and the primary language of instruction is German. A few master\'s degree programs are taught in English, including programs in American studies, economics and international health. The university collaborates with several outside organizations on research activities, including the German Cancer Research Centre, the European Laboratory for Molecular Biology and the Heidelberg Institute for Theoretical Studies. One research achievement associated with Heidelberg University is the creation of the Bunsen burner. The professor for whom the now-common chemistry device is named taught at Heidelberg and, with others, invented the burner.', 8.706163, 49.411428, 'https://www.usnews.com/education/best-global-universities/heidelberg-university-506277');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (49, 'Monash University', 59, 'Clayton, Victoria', 'Australia', 'Wellington Rd\nClayton, Victoria 3800\nAustralia', 'http://www.monash.edu.au/ ', 'Monash University is a public institution that was established in 1958. It is located in the state of Victoria in southeastern Australia and is named after Sir John Monash, an Australian military leader and engineer. The Clayton campus, the largest of the university’s five Australian sites, is situated around 12 miles southeast of Victoria\'s capital city, Melbourne. Monash University also has a branch campus in Malaysia, a graduate school in China jointly run with  and several other affiliated international sites. Students at Monash hail from more than 100 countries. International students pay higher tuition at Monash, though some scholarships are available. Three of the university\'s Australian campuses offer on-campus student housing.The university has many academic divisions: art, design and architecture; arts; business and economics; education; engineering; information technology; law; medicine, nursing and health sciences; pharmacy and pharmaceutical sciences; and science. The language of instruction at Monash is English, and the university follows a semester-based academic calendar. Undergraduates can enroll in honors programs that offer a fourth year of study, heavily focused on research. In Australia, a bachelor honors degree is a higher-level credential than a bachelor\'s degree. Monash University has student-exchange agreements with upward of 100 partner universities in more than 25 countries. Some of the university\'s research centers and institutes are the Monash Injury Research Institute, the Monash Centre for Atomically Thin Materials and the Monash Sustainable Development Institute.', 145.135602, -37.91557, 'https://www.usnews.com/education/best-global-universities/monash-university-500301');
