INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (55, 'Karolinska Institute', 51, 'Stockholm', 'Sweden', 'Solnavägen 1, Solna\nStockholm, SE-171 77\nSweden', 'http://ki.se/en/startpage', 'The Karolinska Institute is a public institution that was founded in 1810 as a school for army surgeons. It is located in Sweden, with the Solna campus just outside the Stockholm city center and the Huddinge Campus to the south. The school offers degrees solely in the medical and health sciences. Around one-fifth of the Karolinska Institute student body is international. Students from European Union and European Economic Area countries as well as Switzerland do not pay tuition; all other students do. Some university housing is available, and tuition-paying students are guaranteed accommodations.The institute offers programs in a variety of medical and health fields, including dentistry, optometry and nursing, to name a few. Its academic calendar is semester-based. The primary language of instruction at the school is Swedish, but several degree programs, known as global bachelor\'s and global master\'s programs, are offered in English. Some of the English-taught master\'s offerings are programs in bioentrepreneurship, global health and public health sciences. The institution offers a three-day intensive Swedish language class to all new international students. Research is prevalent at the Karolinska Institute and covers nine main focus areas, which include cancer and hematology, epidemiology and public health sciences, and neuroscience. More than 40 percent of the academic medical research conducted in Sweden occurs at the school. Since 1901, a committee of 50 Karolinska Institute professors has selected the recipients of the Nobel Prize in physiology or medicine.', 18.023658, 59.348148, 'https://www.usnews.com/education/best-global-universities/karolinska-institute-503151');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (56, 'Peking University', 59, 'Beijing', 'China', 'No.5 Yiheyuan Road\nBeijing, 100871\nChina', 'http://english.pku.edu.cn/ ', 'Peking University is a public institution that was founded in 1898, though it wasn\'t known by its current name until 1912. The university’s main campus, known as Yan Yuan, is located in the Haidian District in the western suburbs of Beijing, China\'s capital city.?University housing is available for both undergraduate and graduate students. Tuition costs are higher for non-Chinese nationals and vary by subject, with science subjects costing more. The university’s academic calendar is semester-based, and students typically study four years for undergraduate degree programs, two to three years for master\'s programs and four years for doctoral degree programs. PKU, as the university is sometimes called, has academic departments focused on various humanities, social sciences and science disciplines. The language of instruction for undergraduates is Chinese, and graduate-level programs are taught in either Chinese or English. In 2000, Beijing Medical University was incorporated into PKU and renamed?the Peking University Health Science Center, which is now the home of PKU’s medical programs, including pharmaceutics and?nursing.?T', 116.268805, 40.001617, 'https://www.usnews.com/education/best-global-universities/peking-university-501148');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (57, 'Utrecht University', 55, 'Utrecht', 'Netherlands', 'P.O Box 80125\nUtrecht, 3508 TC\nNetherlands', 'http://www.uu.nl/en/Pages/default.aspx', 'Utrecht University is a public institution that was founded in 1636. It is located in the city of Utrecht in the Netherlands, less than 30 miles south of Amsterdam. The university has four locations, and its main campus is the Utrecht Science Park - De Uithof campus, situated east of the Utrecht city center. Around 30,000 students attend the university, and tuition costs are higher for students from non-European Union and non-European Economic Area countries, with the exception of Swiss and Surinamese students. Students can apply for housing in dormitories managed by an outside organization.The university has seven main academic divisions: geosciences; humanities; law, economics and governance; medicine; science; social and behavioral sciences; and veterinary medicine. Additionally, there are two university colleges – University College Roosevelt and University College Utrecht – focused on liberal arts education for undergraduates as well as a center for teaching and learning. All told, the university offers around 45 bachelor’s degree programs and more than 130 master’s degree programs. Dutch is the primary language of instruction, though a handful of bachelor’s programs and more than 80 master\'s programs are English-taught. Examples of master\'s programs taught in English are those in banking and finance, the cultural history of modern Europe and religious studies.Much of the research at Utrecht University is structured around the four strategic themes of dynamics of youth, institutions for open societies, life sciences and sustainability. Some of the university’s research institutes are the Copernicus Institute of Sustainable Development and the Institute for Marine and Atmospheric Research.', 5.122602, 52.090153, 'https://www.usnews.com/education/best-global-universities/utrecht-university-505962');
