INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (65, 'University of Southern California', 69, 'Los Angeles, CA', 'United States', 'University Park\nLos Angeles, California 90089\nUnited States', 'http://www.usc.edu/', '', -118.2856, 34.0203, 'https://www.usnews.com/education/best-global-universities/university-of-southern-california-123961');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (66, 'University of Tokyo', 74, 'Bunkyo-ku, Tokyo', 'Japan', '7-3-1 Hongo\nBunkyo-ku, Tokyo, 113-0033\nJapan', 'http://www.u-tokyo.ac.jp/en/', 'The University of Tokyo, also known as UTokyo or Todai, is a Japanese national university that was founded in 1877. The university has three main campuses – the Hongo, Komaba and Kashiwa campuses – and additional facilities located in other parts of Japan. The university is affiliated with two hospitals: the University Hospital and the Institute of Medical Science Hospital. In a recent year, roughly half of the student body was studying at the undergraduate level. Tuition costs are the same for domestic and international students, and some university student housing is available.UTokyo has 10 main academic divisions for undergraduate education: agriculture, arts and sciences, economics, education, engineering, law, letters, medicine, pharmaceutical sciences and science. Undergraduates take liberal arts courses during their first two years of studies and specialize during the last two years. Of the university’s 15 graduate schools, 10 are closely related to corresponding undergraduate divisions. The other five graduate schools focus on frontier sciences, information science and technology, interdisciplinary information studies, mathematical sciences and public policy. The university’s academic calendar has four terms. The primary language of instruction is Japanese, but a few undergraduate programs and even more graduate-level programs are taught in English. The English-taught graduate offerings include an international program in economics as well as a program in architecture and urban design. UTokyo’s research centers and affiliated institutes include the Atmosphere and Ocean Research Institute, the Institute for Advanced Studies on Asia and the Center for Spatial Information Science.', 139.761989, 35.712678, 'https://www.usnews.com/education/best-global-universities/university-of-tokyo-500248');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (67, 'Universite Sorbonne Paris Cite-USPC (ComUE)', 67, 'Paris', 'France', '190 Avenue de France\nParis, 75013\nFrance', 'http://www.sorbonne-paris-cite.fr/fr', '', 2.371734, 48.836158, 'https://www.usnews.com/education/best-global-universities/universite-sorbonne-paris-cite-uspc-comue-529377');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (68, 'Technical University of Munich', 77, 'Munich', 'Germany', 'Arcisstraße 21\nMunich, 80333\nGermany', 'http://www.tum.de/en/homepage/ ', 'The Technical University of Munich, sometimes called TUM, is a public institution that was founded in 1868. The university has three locations in the German state of Bavaria – downtown Munich, Garching and Weihenstephan. The Garching campus, located north of Munich, has the largest enrollment and is home to TUM\'s natural sciences and technology divisions. In general, students do not pay tuition at the university but rather pay semester fees. TUM does not have its own student housing, though accommodations managed by outside organizations are available.The university has 13 academic divisions: architecture; chemistry; civil, geo and environmental engineering; education; electrical and computer engineering; informatics; life sciences; management; math; mechanical engineering; medicine; physics; and sport and health sciences. In all, the university offers more than 150 degree programs, and the primary language of instruction is German. However, TUM offers more than three dozen programs that are taught completely in English as well as a number of bilingual programs, most of which are at the master\'s level. The university’s academic calendar is semester-based. The university has a number of research centers, including the Munich Center for Technology in Society, the Walter Schottky Institut for the study of nanotechnology and nanomaterials and the Hans Eisenmann-Zentrum for agricultural sciences. The Erlenmeyer flask, a piece of equipment commonly found in chemistry labs that is used to measure and store liquids, was named after one of TUM\'s founding professors.', 11.568524, 48.148754, 'https://www.usnews.com/education/best-global-universities/technical-university-of-munich-503109');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (69, 'University of New South Wales', 64, 'Kensington, New South Wales', 'Australia', 'High St.\nKensington, New South Wales 2052\nAustralia', 'http://www.unsw.edu.au/ ', '', 151.231307, -33.91741, 'https://www.usnews.com/education/best-global-universities/university-of-new-south-wales-502434');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (70, 'University of Zurich', 58, 'Zürich', 'Switzerland', 'Rämistrasse 71\nZürich, CH-8006\nSwitzerland', 'http://www.uzh.ch/index_en.html', '', 8.548884, 47.374595, 'https://www.usnews.com/education/best-global-universities/university-of-zurich-505287');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (71, 'University of California--Irvine', 78, 'Irvine, CA', 'United States', 'Irvine, California 92697\nUnited States', 'http://www.uci.edu', '', -117.841, 33.6468, 'https://www.usnews.com/education/best-global-universities/university-of-california-irvine-110653');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (72, 'Australian National University', 69, 'Canberra, Australian Capital Territory', 'Australia', 'Canberra, Australian Capital Territory 0200\nAustralia', 'http://www.anu.edu.au/', 'The Australian National University was founded in 1946. The public institution’s main Acton Campus is located in Australia’s capital city, Canberra. Other university sites include the Mount Stromlo Observatory and the Siding Spring Observatory, both associated with the ANU Research School of Astronomy and Astrophysics. Tuition costs vary by subject and are generally higher for international students. University housing is available for both undergraduate and graduate students; in a recent year, more than 20 percent of the university\'s student body lived on campus. A year of housing is guaranteed for first-year undergraduate students from outside the Canberra region. The university has seven colleges: arts and social sciences; Asia and the Pacific; business and economics; engineering and computer science; law; medicine, biology and environment; and physical and mathematical sciences. The language of instruction is English, and the university’s academic calendar is semester-based. The university has student exchange partnerships with upward of 150 universities in more than 30 countries, including the  in Canada and the  in Germany. As is true at other Australian universities, undergraduate students can enroll in degree programs that place them on a path to earn an honors degree – a more advanced credential than a bachelor\'s degree. Honors degree programs focus heavily on research. Some of the Australian National University\'s many research facilities are the John Curtin School of Medical Research, the Climate Change Institute and the National Centre for Epidemiology and Population Health.', 149.115176, -35.28177, 'https://www.usnews.com/education/best-global-universities/australian-national-university-503825');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (73, 'Erasmus University Rotterdam', 74, 'Rotterdam', 'Netherlands', 'Burgemeester Oudlaan 50\nRotterdam, 3062 PA\nNetherlands', 'http://www.eur.nl/english/', 'Erasmus University Rotterdam is a public institution that traces its roots back to 1913. However, the university did not come to exist as it does today until 1973, when the Medical Faculty Rotterdam and the Netherlands School of Economics merged. The university is primarily located in Rotterdam, one of the largest cities in the Netherlands. It is spread across four campuses, including Campus Woudestein, the main location, and Erasmus University College, a residential liberal arts school. Tuition is higher for students from non-European Union and non-European Economic Area countries, with the exception of Swiss and Surinamese students. Student housing is available through organizations unaffiliated with the university.The university has seven academic divisions: economics; law; social sciences; medicine; philosophy; history, culture and communication; and management. There are also three academic institutes – the Institute of Health Policy and Management, the International Institute of Social Studies and the Institute for Housing and Urban Development Studies. The primary language of instruction for bachelor’s programs is Dutch, but some English-taught undergraduate programs are offered. A number of the university\'s graduate courses of study are also taught in English, including a master\'s program in strategic entrepreneurship as well as an international MBA program. Education and research activities at the university are primarily focused on four key areas of study: health, wealth (economics and business), governance and culture. Some of the university\'s research institutes and centers are the Erasmus University Rotterdam Institute for Behavior and Biology, the Rotterdam Institute for Shipping and Transport Law and the Centre for Historical Culture.', 4.526023, 51.917448, 'https://www.usnews.com/education/best-global-universities/erasmus-university-rotterdam-500349');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (74, 'Vanderbilt University', 72, 'Nashville, TN', 'United States', 'Nashville, Tennessee 37240\nUnited States', 'http://www.vanderbilt.edu', '', -86.8031, 36.1469, 'https://www.usnews.com/education/best-global-universities/vanderbilt-university-221999');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (75, 'University of Adelaide', 80, 'Adelaide, South Australia', 'Australia', 'North Terrace\nAdelaide, South Australia 5005\nAustralia', 'http://www.adelaide.edu.au/ ', '', 138.599533, -34.921623, 'https://www.usnews.com/education/best-global-universities/university-of-adelaide-504015');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (76, 'University of California--Santa Cruz', 76, 'Santa Cruz, CA', 'United States', '1156 High Street\nSanta Cruz, California 95064\nUnited States', 'http://www.ucsc.edu', 'The University of California—Santa Cruz, or UCSC, is a public institution that was founded in 1965. The school is located along California\'s coast, around 75 miles south of San Francisco. The school is also just south of Silicon Valley, which means many research, internship and employment opportunities are nearby for students. More than 17,000 students attended the university in a recent year, and around 90 percent of them were studying at the undergraduate level. Non-California residents pay a supplemental tuition. Around half of the UCSC student body lives on campus, and housing options include the university\'s 10 undergraduate residential colleges. All undergrads become affiliated with one of the residential colleges, each of which offers academic support services and social activities. Housing is guaranteed for four years for undergraduate international students who enter as freshmen.The university offers studies in the arts, humanities, physical and biological sciences, social sciences and engineering. In all, UCSC offers around 60 undergraduate majors as well as graduate studies in approximately 40 fields. The language of instruction is English, and the university follows a quarter-based academic calendar. A sampling of the university\'s research groups includes the Center for Agroecology & Sustainable Food Systems, the Center for Games and Playable Media and the Institute of Marine Sciences. Both undergraduate and graduate students participate in research at UCSC. In fact, more than 70 percent of undergraduates are involved with research during the course of their studies. Undergrads can choose to work on ongoing university research projects or develop their own independent projects with faculty guidance.', -122.0528, 36.9781, 'https://www.usnews.com/education/best-global-universities/university-of-california-santa-cruz-110714');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (77, 'Wageningen University and Research Center', 79, 'Wageningen', 'Netherlands', 'Droevendaalsesteeg 4\nWageningen, 6708 PB\nNetherlands', 'http://www.wageningenur.nl/en.htm', '', 5.66577, 51.984556, 'https://www.usnews.com/education/best-global-universities/wageningen-university-and-research-center-501112');
