INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (81, 'University of Bristol', 81, 'Bristol', 'United Kingdom', 'Tyndall Avenue\nBristol, BS8 1TH\nUnited Kingdom', 'http://www.bris.ac.uk/', '', -2.602056, 51.45913, 'https://www.usnews.com/education/best-global-universities/university-of-bristol-505342');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (82, 'University of Oxford', 5, 'Oxford', 'United Kingdom', 'Wellington Square\nOxford, OX1 2JD\nUnited Kingdom', 'http://www.ox.ac.uk/', 'The exact date of the University of Oxford’s founding isunknown, but the school traces its roots back to at least 1096. Oxford is locatedaround 60 miles northwest of London, and around 45 percent of its student body is made up of graduate students. More than halfof Oxford’s graduate students conduct research as part of their studies. Research at Oxford takesplace in all four of its academic divisions: humanities; mathematical, physicaland life sciences; medical sciences; and social sciences. Oxford’sacademic calendar is divided into three terms – Michaelmas (fall), Hilary (spring) and Trinity (summer)– each eight weeks long. The language of instruction at the university isEnglish.The University of Oxford is made up of a centraluniversity; 38 colleges; and six Permanent Private Halls, which tend to besmaller than colleges and offer fewer subjects. The colleges at Oxford are eachequipped with a dining hall, common room and library. Undergraduates are guaranteedcollege housing for their freshman year and can often continue to live thereduring the later years of their studies. Graduate students are not guaranteed housingbut some colleges may have space for them during their first year, especiallyfor international students. Tuition costs are higher for non-European Unionstudents. The university and its academic departments and colleges, as well asdozens of external organizations, have made more than 900 scholarshipsavailable for graduate students.', -1.262382, 51.757351, 'https://www.usnews.com/education/best-global-universities/university-of-oxford-503637');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (83, 'University of Texas--Austin', 34, 'Austin, TX', 'United States', 'Austin, Texas 78712-1111\nUnited States', 'http://www.utexas.edu', '', -97.7371, 30.2863, 'https://www.usnews.com/education/best-global-universities/university-of-texas-austin-228778');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (84, 'Leiden University', 89, 'Leiden', 'Netherlands', 'Rapenburg 70\nLeiden, 2311 EZ\nNetherlands', 'http://www.leiden.edu/', 'Leiden University is a public institution that was founded in 1575, making it the oldest university in the Netherlands. It is located in the city of Leiden, with facilities just a few miles away in The Hague as well. Students from countries outside the European Union and European Economic Area, with the exception of Swiss and Surinamese students, pay higher tuition. The university does not operate its own student housing, but the school housing office helps international students secure accommodations managed by an outside organization.The university has seven main academic divisions: archaeology, governance and global affairs, humanities, law, medicine, science, and social and behavioral sciences. In all, the university offers upward of 40 bachelor’s and 70 master’s programs. Most Leiden University bachelor’s programs are taught in Dutch, though a handful of English-taught programs are available. The primary language of instruction for graduate programs is English. The university’s academic calendar is semester-based. Leiden University has 11 research focus areas, including brain function and dysfunction over the lifespan, interaction between legal systems and language diversity in the world. The university is involved with the Leiden Bio Science Park – a cluster of more than 170 businesses, research institutes and other organizations focused in large part on drug research and development. Some of the university’s facilities are located in the science park, including the faculties of science and social sciences, as well as the Leiden University Medical Center.', 4.485209, 52.157148, 'https://www.usnews.com/education/best-global-universities/leiden-university-503069');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (85, 'PSL Research University Paris (ComUE)', 82, 'Paris', 'France', '60 Rue Mazarine\nParis, 75006\nFrance', 'https://www.psl.eu/en', '', 2.337842, 48.854619, 'https://www.usnews.com/education/best-global-universities/psl-research-university-paris-comue-529378');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (86, 'VU University Amsterdam', 82, 'Amsterdam', 'Netherlands', 'De Boelelaan 1105\nAmsterdam, 1081 HV\nNetherlands', 'http://www.vu.nl/en/', 'VU University Amsterdam is a public institution that was founded in 1880. The Dutch university is located in the Zuidas district of Amsterdam, and it enrolled around 23,000 students in a recent year. Tuition costs are higher for non-European Union and non-European Economic Area students. Furnished and unfurnished university accommodations are available for international degree-seeking and exchange students.The university has 10 main academic divisions: dentistry, economics and business administration, earth and life sciences, behavioral and movement sciences, humanities, law, medicine, sciences, social sciences and theology. In a recent year, the university offered more than 50 bachelor\'s programs and 160 master\'s programs. Several English-taught international bachelor\'s degree programs – including programs in business analytics, computer science and psychology – are available, but the majority of undergrad programs are taught in Dutch. Both Dutch- and English-speaking students have a variety of master\'s programs to choose from at the university. Around a quarter of the students enrolled in English-taught programs at VU University Amsterdam are international. The school follows a semester-based academic calendar.The four main teaching and research themes at the university are governance for society, human health and life sciences, connected world and science for sustainability. Some of the university\'s research centers are the Amsterdam Center for Career Research, the Amsterdam Center for Entrepreneurship and the Institute for Cardiovascular Research. The university is also affiliated with the VU University Medical Center, a teaching hospital.', 4.866201, 52.33464, 'https://www.usnews.com/education/best-global-universities/vu-university-amsterdam-500669');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (87, 'University of Arizona', 85, 'Tucson, AZ', 'United States', 'Tucson, Arizona 85721\nUnited States', 'http://www.arizona.edu', '', -110.9484, 32.2337, 'https://www.usnews.com/education/best-global-universities/university-of-arizona-104179');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (88, 'University of Western Australia', 86, 'Crawley, Western Australia', 'Australia', '35 Stirling Highway\nCrawley, Western Australia 6009\nAustralia', 'http://www.uwa.edu.au/ ', '', 115.811085, -31.977827, 'https://www.usnews.com/education/best-global-universities/university-of-western-australia-503979');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (89, 'Ghent University', 87, 'Gent', 'Belgium', 'Sint-Pietersnieuwstraat 25\nGent, 9000\nBelgium', 'https://www.ugent.be/en ', '', 3.726754, 51.045488, 'https://www.usnews.com/education/best-global-universities/ghent-university-506883');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (90, 'Humboldt-Universität zu Berlin', 91, 'Berlin', 'Germany', 'Unter den Linden 6\nBerlin, 10099\nGermany', 'http://www.hu-berlin.de/?set_language=en ', 'Humboldt-Universität zu Berlin is a public institution in Germany that was founded in 1810. The university’s campuses include Campus Adlershof, home to the natural sciences; Campus Mitte, where the arts and humanities are based, as well as law, economics and business, and theology; and Campus Nord, the university’s hub for the life sciences. In a recent year, roughly half of the university\'s students were pursuing bachelor’s degrees. Humboldt-Universität does not charge students for tuition. Instead, students pay a relatively low semester fee, which is generally the case at public universities in Germany. Some student housing is available through Studentenwerk, a public organization that manages various services for university students in the region.The university comprises many academic divisions, including faculties of arts and humanities, economics and business administration, law, life sciences, mathematics and natural sciences, medicine, social sciences and theology. The primary language of instruction at Humboldt-Universität is German, and the university’s academic calendar is semester-based. The university\'s medical school, , is jointly operated with the . In a recent year, nearly 7,000 students were enrolled at Charite. Humboldt-Universität has cooperation agreements of varying types with more than 190 institutions around the world. For example, the university has teaching and research partnerships with the ,  in the U.S. and Brazil\'s . The university has several major interdisciplinary research centers, such as the August Boeckh Centre for Antiquity and the Georg-Simmel Center for Metropolitan Studies.', 13.394381, 52.518617, 'https://www.usnews.com/education/best-global-universities/humboldt-universitat-zu-berlin-506698');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (91, 'University of Barcelona', 98, 'Barcelona', 'Spain', 'Gran Via de les Corts Catalanes, 585\nBarcelona, 08007\nSpain', 'http://www.ub.edu/web/ub/en/', 'The University of Barcelona is a public institution that was founded in 1450. The urban university has multiple campuses spread throughout Barcelona and the surrounding area on the eastern coast of Spain. The Humanities Campus in the city center is the university\'s main location. Other university sites include the Bellvitge Health Sciences Campus and the Food and Nutrition Torribera Campus. Tuition costs are the same for international and domestic degree-seeking students. Some university-owned and -affiliated student housing is available for both undergraduate and graduate students.The university has many academic divisions, including biology, economics and business, law, medicine and health sciences, philosophy and psychology. Additionally, the University of Barcelona is affiliated with eight centers through collaboration agreements, including the School of Cinema and Audiovisual Studies of Catalonia, the Institute of Public Security of Catalonia and the National Institute of Physical Education. The university’s academic calendar is semester-based. Courses are primarily taught in Spanish and Catalan, since Barcelona is located in the Catalonia region, although a handful of bachelor’s and even more master’s programs are fully or partially English-taught. Examples of completely English-taught offerings include a bachelor\'s program in business administration and management as well as master\'s programs in economics and international relations. Some of the university’s many research institutes and centers are the Institute of Cosmos Sciences, the Water Research Institute and the Institute of Space Studies of Catalonia.', 2.164027, 41.38707, 'https://www.usnews.com/education/best-global-universities/university-of-barcelona-500261');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (92, 'University of Birmingham', 96, 'Birmingham', 'United Kingdom', 'Edgbaston\nBirmingham, B15 2TT\nUnited Kingdom', 'http://www.birmingham.ac.uk/index.aspx', '', -1.926489, 52.44977, 'https://www.usnews.com/education/best-global-universities/university-of-birmingham-501524');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (93, 'University of Geneva', 94, 'Geneva', 'Switzerland', '40 bd du Pont-d’Arve\nGeneva, CH-1211\nSwitzerland', 'http://www.unige.ch/international/index_en.html', '', 6.145116, 46.199444, 'https://www.usnews.com/education/best-global-universities/university-of-geneva-504635');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (94, 'Weizmann Institute of Science', 99, 'Rehovot', 'Israel', '234 Herzl Street\nRehovot, 7610001\nIsrael', 'http://www.weizmann.ac.il/ ', '', 34.811363, 31.907867, 'https://www.usnews.com/education/best-global-universities/weizmann-institute-of-science-506795');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (95, 'University of Helsinki', 87, 'Helsinki', 'Finland', 'Yliopistonkatu 4\nHelsinki, 00014\nFinland', 'http://www.helsinki.fi/university/ ', '', 24.951042, 60.172635, 'https://www.usnews.com/education/best-global-universities/university-of-helsinki-501989');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (96, 'Lund University', 91, 'Lund', 'Sweden', 'Paradisgatan 2\nLund, SE-221 00\nSweden', 'http://www.lunduniversity.lu.se/', 'Lund University is a public institution that was founded in 1666. Its main campus is in Lund, Sweden, with additional campuses in Helsingborg, Ljungbyhed and Malmö. The Lund campus is roughly 40 miles west of Copenhagen, . International students at the university hail from more than 130 countries. Tuition is free for students from countries in the European Union and European Economic Area as well as Switzerland. International students from outside these areas generally are charged tuition. Some university housing is available for both undergraduate and graduate students.The university has eight main academic divisions – engineering, science, law, social sciences, medicine, humanities and theology, economics and management, and fine and performing arts – and a school of aviation. In all, more than 75 bachelor’s programs and around 220 master’s programs are available. The university follows a semester-based academic calendar. Lund University students generally take one course at a time, with the exception of engineering students who usually take two, and a course can last anywhere from two to 20 weeks. The primary language of instruction at the undergraduate level is Swedish, but a handful of English-taught bachelor’s programs are offered. There are many master\'s programs taught in English, including ones in economics, finance and international human law. Some of Lund University\'s research institutes and centers are the Lund University Centre for Sustainability Studies, the Lund University Diabetes Centre and the Max IV Laboratory, used for synchrotron radiation research.', 13.203493, 55.711948, 'https://www.usnews.com/education/best-global-universities/lund-university-500083');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (97, 'University of Groningen', 96, 'Groningen', 'Netherlands', 'Broerstraat 5\nGroningen, 9700 AB\nNetherlands', 'http://www.rug.nl/?lang=en', 'The University of Groningen is a public institution that was founded in 1614, making it one of the oldest universities in the Netherlands. It is located primarily in the city of Groningen, approximately 115 miles northeast of Amsterdam. The University of Groningen does not have one clearly defined campus area; university buildings are located throughout the city. Tuition is higher for students from non-European Union and non-European Economic Area countries, with the exception of Swiss nationals. The university does not operate its own housing, but it does reserve rooms for international students in facilities that SSH, an outside organization, manages.The university has academic divisions focused on a variety of subjects: economics and business, behavioral and social sciences, theology and religious studies, arts, medical sciences, law, spatial sciences, philosophy, and mathematical and natural sciences. The University College Groningen, an undergraduate liberal arts and sciences college where English is the language of instruction, and a new branch campus – Campus Fryslân – are also part of the institution. Overall, the university offers upward of 45 bachelor’s and more than 100 master’s degree programs, as well as doctoral programs. The university follows a semester-based academic calendar. Some undergraduate and most graduate-level degree programs at the University of Groningen are available in English, while the rest are taught in Dutch. University research is generally focused on three main subject areas: energy, healthy aging and sustainable society. The university’s research institutes include the Zernike Institute for Advanced Materials, the Stratingh Institute for Chemistry and the Kapteyn Astronomical Institute.', 6.562987, 53.219263, 'https://www.usnews.com/education/best-global-universities/university-of-groningen-500967');
