INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (104, 'Uppsala University', 102, 'Uppsala', 'Sweden', 'Biskopsgatan 3\nUppsala, SE-751 05\nSweden', 'http://www.uu.se/en', 'Uppsala University is a public institution that was founded in 1477. It is located primarily in Uppsala, Sweden, a city around 45 miles north of Stockholm. In addition to facilities located in different areas of Uppsala, the university has a campus located on the Swedish island of Gotland. Some programs only available at the Gotland campus are conservation as well as game design. Students from European Union and European Economic Area countries and Switzerland do not pay tuition. But international students from outside these areas are charged tuition, which varies by academic discipline, with medical, science and technology-related studies costing more. The university does not provide housing, except to exchange students and tuition-paying master’s students. Outside housing organizations manage the residences for the school.The university offers studies in the humanities and social sciences, medical and pharmaceutical, and science and technology disciplines. The school’s academic calendar is semester-based. The university’s medical programs are affiliated with Uppsala University Hospital, where clinical training and research take place. The primary language of instruction is Swedish for undergraduate programs, but a number of both Swedish- and English-taught master\'s programs are available. All of the university\'s international master\'s offerings are English-taught, including programs in computer science, entrepreneurship, and peace and conflict studies. The university has many research centers, including the Uppsala Centre for Russian and Eurasian Studies, the Centre for Natural Disaster Science and the Uppsala RNA Research Center.', 17.630009, 59.8509, 'https://www.usnews.com/education/best-global-universities/uppsala-university-501990');
