INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (108, 'University of Hong Kong', 100, 'Pok Fu Lam, Hong Kong', 'Hong Kong', 'Pok Ful Lam Road\nPok Fu Lam\nHong Kong', 'http://www.hku.hk/ ', '', 114.137085, 22.282999, 'https://www.usnews.com/education/best-global-universities/university-of-hong-kong-505046');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (109, 'University of Bonn', 108, 'Bonn', 'Germany', 'Regina-Pacis-Weg 3\nBonn, 53012\nGermany', 'http://www3.uni-bonn.de/ ', 'The University of Bonn is a public institution that was founded in 1818. The university has facilities located throughout Bonn, a city in western Germany near the Rhine River. The city was the birthplace of the late composer Ludwig van Beethoven, and today is home to several United Nations organizations. In a recent year, more than 30,000 students were enrolled at the university and around 12 percent of the total student body was international, with students hailing from around 135 countries. The University of Bonn generally does not charge students for tuition, though students do pay a relatively low social fee each semester. This fee covers a public transportation pass, library access and other student services. Some student housing is available through the public organization Studierendenwerk Bonn.The university has seven main academic divisions – agriculture, arts, Catholic theology, law and economics, mathematics and natural sciences, medicine and Protestant theology – and follows a semester-based academic calendar. German is the primary language of instruction, though some English-taught or bilingual degree programs are available, mostly at the graduate level. Some of the English-taught master\'s options include programs in computer sciences, economics and mathematics. The university also offers language courses to help international students learn everyday German. Research bodies at the university include the Laboratory for Experimental Economics, the Bethe Center for Theoretical Physics and the Franz Joseph Dölger-Institut, focused on the study of late antiquity. The university has established partnerships with more than 70 global universities, including the , the  and the  in the Netherlands.', 7.086523, 50.726772, 'https://www.usnews.com/education/best-global-universities/university-of-bonn-504578');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (110, 'Chinese University Hong Kong', 113, 'Shatin, New Territories', 'Hong Kong', 'Shatin, New Territories\nHong Kong', 'http://www.cuhk.edu.hk/english/index.html ', '', 114.207482, 22.420458, 'https://www.usnews.com/education/best-global-universities/chinese-university-hong-kong-502973');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (111, 'Purdue University--West Lafayette', 114, 'West Lafayette, IN', 'United States', 'Schleman Hall, 475 Stadium Mall Drive\nWest Lafayette, Indiana 47907-2050\nUnited States', 'http://www.purdue.edu', '', -86.9172, 40.4242, 'https://www.usnews.com/education/best-global-universities/purdue-university-west-lafayette-243780');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (112, 'Rice University', 108, 'Houston, TX', 'United States', '6100 Main St\nHouston, Texas 77005\nUnited States', 'http://www.rice.edu', '', -95.5413, 29.7052, 'https://www.usnews.com/education/best-global-universities/rice-university-227757');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (113, 'Université Paris-Sud ', 118, 'Orsay', 'France', '300 Rue du Château\nOrsay, 91405\nFrance', 'http://www.u-psud.fr/en/index.html', 'The Université Paris-Sud is a public institution that was founded in 1970. The university has five campuses located in the southern suburbs of Paris. The main campus is in Orsay, some 20 miles from the Paris city center. In a recent year, around 30,000 students attended the university, and roughly 45 percent of them studied at the undergraduate level. Approximately 16 percent of the student body was international during that period, with students hailing from around 125 different countries. Students pay admission fees that vary by degree level but do not pay tuition, with a small handful of exceptions. This is also the case at other public universities in France. Students can apply for housing through CROUS, a public organization that manages accommodations and other services for university students in the region.The university has academic divisions focused on law, economics and management; medicine; pharmacy; science; and sport sciences. The institution also has three university institutes of technology – Cachan IUT, Sceaux IUT and Orsay IUT – and a school of engineering. The academic calendar at the Université Paris-Sud is semester-based, and the primary language of instruction is French, although some degree programs are taught in English. Among the English-taught offerings are master\'s programs in biology, physics and computer science. Research at the Université Paris-Sud takes place in more than 70 laboratories, and undergraduates can work as student assistants in university labs. Food and agriculture, pharmacy and nanosciences are among the institution\'s key research areas.', 2, 49, 'https://www.usnews.com/education/best-global-universities/universite-paris-sud--502000');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (114, 'Freie Universität Berlin', 122, 'Berlin', 'Germany', 'Kaiserswerther Straße 16-18\nBerlin, 14165\nGermany', 'http://www.fu-berlin.de/en/ ', 'The Free University of Berlin is a public institution that was founded in 1948. The university has three main campuses in Berlin. Additionally, Free University and  jointly operate the , which enrolls students affiliated with both universities. In a recent year, roughly 16 percent of the Free University student body was pursuing doctoral degrees. Students do not pay tuition for most degree programs, which is generally the case at public universities in Germany. Student housing is available, though the accommodations are not located on campus and are managed by outside organizations that have agreements with the university.The university has 11 academic departments, the joint medical school as well as three central institutes that offer degrees in Eastern European, Latin American and North American studies. In all, Free University offers some 180 bachelor\'s and master\'s degree programs as well as around 50 doctoral programs. The university’s academic calendar is semester-based, with courses beginning in October and April. The primary language of instruction is German, though the university offers some English-taught programs, most of which are at the master\'s level. The English-taught master\'s offerings include programs in computational sciences, international health and North American studies. Around 600 international scholars and scientists come to the university each year to serve in teaching and research roles. Among the university’s interdisciplinary research focus areas are plant sciences, functional materials at the nanoscale and disease in human aging.', 13.289679, 52.452526, 'https://www.usnews.com/education/best-global-universities/freie-universitat-berlin-502084');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (115, 'University of Bern', 112, 'Bern', 'Switzerland', 'Hochschulstrasse 4\nBern, CH-3012\nSwitzerland', 'http://www.unibe.ch/eng/', '', 7.436584, 46.949792, 'https://www.usnews.com/education/best-global-universities/university-of-bern-505657');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (116, 'University of Bologna', 116, 'Bologna', 'Italy', 'Via Zamboni, 33\nBologna, 40126\nItaly', 'http://www.unibo.it/en/homepage ', 'The University of Bologna is a public institution that traces its roots back to 1088. In a recent year, around 85,000 students attended the Italian university, and roughly seven percent of the student body was international. The institution has five campuses located in Bologna, Cesena, Forlì, Ravenna and Rimini. The university’s main campus is in Bologna; about three-quarters of the student body studies there. The university also has a campus in Buenos Aires, Argentina. Tuition costs vary by subject and are not higher for international students. Student housing, which an outside organization manages, is available.The university has 11 schools: agriculture and veterinary medicine; arts, humanities and cultural heritage; economics, management and statistics; engineering and architecture; foreign languages and literatures, interpreting and translation; law; medicine; pharmacy, biotechnology and sport science; political sciences; psychology and education; and science. In all, the university offers around 200 degree programs. The University of Bologna’s academic calendar is semester-based, though start dates and examination dates can vary from school to school. The primary language of instruction for nondoctoral programs is Italian, but some programs at these levels are taught in English, including a variety of international degree programs. Some of the international programs lead to dual or joint degrees. At the doctoral level, many programs accept or require English. Some of the university\'s research centers are the “Giorgio Prodi” Cancer Research Center and the University of Bologna Experimental Farm.', 11.352453, 44.496872, 'https://www.usnews.com/education/best-global-universities/university-of-bologna-502210');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (117, 'Kyoto University', 124, 'Sakyo-ku, Kyoto, Kyoto', 'Japan', 'Yoshida-Honmachi\nSakyo-ku, Kyoto, Kyoto 606-8501\nJapan', 'http://www.kyoto-u.ac.jp/en', 'Kyoto University is a Japanese national university that was founded in 1897. Originally known as Kyoto Imperial University, the institution received its current name in 1947. In a recent year, around 23,000 students attended the university. Kyoto University has three campuses – the main Yoshida campus and the Uji and Katsura campuses – as well as facilities located in other areas of Japan, such as field stations for research. Tuition costs are the same for international and domestic students, and some university student housing is available.In all, 10 academic divisions at the university offer undergraduate degrees: integrated human studies, letters, education, law, economics, science, medicine, pharmaceutical sciences, engineering and agriculture. Undergrads take courses in the liberal arts and sciences, as well as in more specialized areas. Kyoto University also has 18 graduate schools, including a school of Asian and African area studies as well as a school of management. The graduate schools offer master\'s, doctoral and professional degree programs.The university’s academic calendar is semester-based, and the primary language of instruction is Japanese. However, some English-taught programs are available, mostly at the graduate level, including a program in international environmental management and an MBA program. The university’s Education Center for Japanese Language and Culture offers 15-week supplementary Japanese language classes for international students and researchers. Some of the research institutes at the university are the Institute for Frontier Medical Sciences, the Disaster Prevention Research Institute and the Primate Research Institute.', 135.780822, 35.026244, 'https://www.usnews.com/education/best-global-universities/kyoto-university-505388');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (118, 'University of Padua', 116, 'Padua', 'Italy', 'Via 8 Febbraio, 2\nPadua, 35122\nItaly', 'http://www.unipd.it/en/ ', 'The University of Padua is a public institution that was founded in 1222. It is located in the city of Padua, in northeast Italy, roughly 25 miles west of Venice. In a recent year, around 60,000 students attended the university. The primary language of instruction at the institution is Italian, but some degree programs – mostly at the graduate level – are taught in English. Tuition costs the same for Italian and international students, and housing is available for both undergraduate and graduate students through the organization ESU di Padova.The university has eight schools: agricultural sciences and veterinary medicine, economics and political science, law, engineering, medicine, psychology, science, and human and social sciences and cultural heritage. The university\'s academic year begins in October and runs into July. The institution uses both semester- and trimester-based academic calendars, depending on the school or program.In addition to standard degree programs, the University of Padua offers joint and double degree programs. These programs are run in collaboration with other international universities, such as  in France and Romania\'s . Thirty high-achieving students are admitted to the university’s Galilean School of Higher Education each year, where – in addition to their regular degree courses – they attend supplemental courses and seminars. Some of the university’s many research centers include the CRIBI Biotechnology Center, the Cognitive Neuroscience Center and the Center of Studies and Activities for Space \"Giuseppe Colombo.\"', 11.877446, 45.406766, 'https://www.usnews.com/education/best-global-universities/university-of-padua-502381');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (119, 'University of Cape Town', 121, 'Cape Town', 'South Africa', 'Lovers Walk, Rondebosch\nCape Town, 7701\nSouth Africa', 'http://www.uct.ac.za/', '', 18.461199, -33.957652, 'https://www.usnews.com/education/best-global-universities/university-of-cape-town-504187');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (120, 'Radboud University Nijmegen', 104, 'Nijmegen', 'Netherlands', 'P.O. Box 9102\nNijmegen, 6500 HC\nNetherlands', 'http://www.ru.nl/english/', '', 5.85701, 51.81882, 'https://www.usnews.com/education/best-global-universities/radboud-university-nijmegen-501519');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (121, 'Stockholm University', 114, 'Stockholm', 'Sweden', 'Universitetsvägen 10A\nStockholm, SE-106 91\nSweden', 'http://www.su.se/english/', 'Stockholm University, located in and around Stockholm, is a public institution that was founded in 1878. The Frescati campus, just north of the Stockholm city center in the Royal National City Park, is the Swedish university’s main location. The university has facilities located in central Stockholm as well as Kista Science City. Students from European Union and European Economic Area countries, plus Switzerland, do not pay tuition, but international students from countries outside these areas generally do. Stockholm University does not provide student housing, except to some exchange and scholarship students.The university’s many departments and centers offer studies in the humanities, law, social sciences, math and physics, chemistry, biology, and earth and environmental sciences. Stockholm University follows a semester-based academic calendar. Both Swedish and English are spoken in the university\'s classrooms; several bachelor’s programs and around 75 master’s degree programs are taught completely in English. The English-taught master\'s offerings include programs in banking and finance, management studies and Middle Eastern studies. Swedish language classes are also available for international and exchange students. The university has exchange and research partnerships with schools around the world, including the  in the U.S. One of Stockholm University\'s many research centers and labs is the Baltic Sea Centre, which is focused on marine research and education. The facility’s resources include the Askö Laboratory in the archipelago south of Stockholm as well as a ship that can be used for research at sea.', 18.059027, 59.362753, 'https://www.usnews.com/education/best-global-universities/stockholm-university-505458');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (122, 'Sapienza University of Rome', 119, 'Rome', 'Italy', 'Piazzale Aldo Moro 5\nRome, 00185\nItaly', 'http://www.uniroma1.it/ ', 'Sapienza University of Rome is a public institution that was founded in 1303 by Pope Boniface VIII. The Italian university was originally called the Studium Urbis but became known as Sapienza in 1660. Its main campus, known as Città Universitaria, is located near the Rome city center. The institution also has facilities in different parts of Rome and the greater Lazio region. More than 110,000 students attended Sapienza University in a recent year. The cost of tuition varies by academic subject, and some university-affiliated student housing is available.The university has 11 academic divisions: architecture; arts and humanities; civil and industrial engineering; economics; information engineering, informatics and statistics; law; mathematics, physics and natural sciences; medicine and dentistry; medicine and psychology; pharmacy and medicine; and political science, sociology and communication science. There is also a school of aerospace engineering. Sapienza uses a semester-based academic calendar, with courses beginning in September and February.Almost all of the university\'s undergraduate programs are taught in Italian, though there are a few English-taught master\'s programs. International joint degree programs – offered in conjunction with other universities – are also available, giving Sapienza students the opportunity to study in Rome and abroad. Sapienza\'s research facilities include centers focused on transport and logistics as well as cyber intelligence and information security. The university’s other academic resources include nearly 60 libraries and a network of 20 museums, including a herbarium and a museum of classical art.', 12.512243, 41.901236, 'https://www.usnews.com/education/best-global-universities/sapienza-university-of-rome-506550');
