INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (130, 'Seoul National University', 128, 'Seoul', 'South Korea', '1 Gwanak-ro, Gwanak-gu\nSeoul, 151-742\nSouth Korea', 'http://www.useoul.edu/', 'Seoul National University was founded in 1946. The South Korean national university’s main location is the Gwanak campus in the city of Seoul. It also has a medical campus and a campus for agricultural education and research. Tuition costs are the same for domestic and international students and vary by subject area. Many of the university’s international students receive support from various types of scholarships that cover some or all of their tuition costs. International students can also participate in a work-study program in which they work on campus for 40-60 hours a month. University housing is available for both undergraduate and graduate students.The university has 16 colleges for undergraduates, a graduate school that offers numerous master’s and doctoral programs and 10 professional schools. The professional schools offer studies in business, environmental studies, convergence science and technology, dentistry, international agriculture technology, international studies, law, medicine, public administration and public health. The primary language of instruction at Seoul National University is Korean, though somewhere between 10 to 20 percent of university courses are English-taught. The colleges of engineering and business have the highest proportion of courses taught in English. Nearly all of the school\'s faculty members – around 95 percent – have doctoral degrees. The university’s academic calendar is semester-based with the school year beginning in March. The university’s research organizations include the Kyujanggak Institute for Korean Studies, the Institute for Peace and Unification Studies and the Big Data Institute.', 126.951905, 37.459882, 'https://www.usnews.com/education/best-global-universities/seoul-national-university-503456');
