INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (140, 'University of Montreal', 139, 'Montréal, Québec', 'Canada', '2900 Boulevard Edouard-Montpetit\nMontréal, Québec H3T 1J4\nCanada', 'http://www.umontreal.ca/english/ ', 'The University of Montreal is a public institution that traces its roots back to 1878. Initially a branch of the Université Laval de Québec, it became an independent institution in 1919. The university is affiliated with two other schools: Polytechnique Montréal, an engineering school, and HEC Montréal, a business school. The university and its affiliated schools are located in Montreal, Quebec – one of the most populous metropolitan areas in Canada. Around one-fourth of the student body across all three institutions studies at the graduate level. The university offers housing for full-time undergraduate and graduate students.UdeM, as the school is sometimes called, has more than a dozen academic divisions that span the social, natural and health sciences, as well as arts and humanities disciplines. The primary language of instruction is French, although several graduate programs – such as doctoral programs in biochemistry, neurosciences and pharmacology – accept English-speaking students. Tutoring, workshops and other resources are available for students who want to improve their French language skills. The university’s academic calendar is based on a semester system, and tuition costs are higher for international students. The Institute for Research in Immunology and Cancer, the Cyberjustice Laboratory and the International Centre for Comparative Criminology are among the university’s many research units. Some University of Montreal researchers collaborate on projects with institutions located in other parts of the world, primarily in France, Germany, Italy, the U.K. and the U.S.', -73.618679, 45.503291, 'https://www.usnews.com/education/best-global-universities/university-of-montreal-506159');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (141, 'University of Science and Technology of China', 128, 'Hefei, Anhui', 'China', 'No. 96 Jinzhai Road\nHefei, Anhui 230026\nChina', 'http://en.ustc.edu.cn/ ', 'The University of Science and Technology of China is a public university that the Chinese Academy of Sciences founded in 1958. USTC, as the university is sometimes called, is situated in Hefei, the capital of China’s Anhui province, and has five campuses within the city located relatively close to each other. Around 1.5 percent of the student body hails from abroad. Many of the university\'s international students receive financial support from one of three sources: the USTC Scholarship, the Chinese Government Scholarship or a fellowship that the Chinese Academy of Sciences and the World Academy of Sciences offers. All three types of aid cover tuition and provide a stipend for other education-related costs. University housing is available for both undergraduate and graduate students.USTC has more than a dozen schools, many of which are devoted to the sciences, but the university also has academic divisions focused on subjects such as public affairs and business. Additionally, the USTC School of the Gifted Young offers instruction for advanced students. The university follows a semester-based academic calendar. The primary language of instruction is Chinese, though some master’s and most doctoral programs are also offered in English. More than 70 percent of undergraduate students participate in USTC’s Research Program for Undergraduates, which takes place at university labs and Chinese Academy of Sciences research institutes. Among the research labs that USTC operates are the National Synchrotron Radiation Laboratory, the Hefei National Laboratory for Physical Sciences at the Microscale and the State Key Laboratory of Fire Science.', 117.257502, 31.820475, 'https://www.usnews.com/education/best-global-universities/university-of-science-and-technology-of-china-505547');
