INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (147, 'Zhejiang University', 157, 'Hangzhou, Zhejiang', 'China', '866 Yuhangtang Road\nHangzhou, Zhejiang 310058\nChina', 'http://www.zju.edu.cn/english/ ', 'Zhejiang University is a public institution that traces its roots back to 1897. The university is located in Hangzhou, the capital of China’s Zhejiang province, about 110 miles southwest of Shanghai. More than 47,000 students attend the university, and around half of them study at the undergraduate level. Zhejiang University comprises seven campuses: the main campus, Zijingang, and the Yuquan, Xixi, Huajiachi, Zhijiang, Zhoushan and Haining campuses. Tuition costs are higher for international students and vary by subject and degree level. University housing is available for both undergraduate and graduate students.The university offers programs in a variety of disciplines, including engineering, the humanities and medicine. In all, students can choose from more than 120 undergraduate programs and well over 300 master\'s programs. Doctoral programs are also available. The primary language of instruction is Chinese, but Zhejiang University also offers more than a dozen master’s degree programs taught in English. The English-taught master’s offerings include programs in business, China studies and engineering. The university follows a four-term academic calendar. University resources include seven affiliated hospitals and a library that houses more than 6.83 million volumes. Among the laboratory facilities at Zhejiang University are more than a dozen national key labs that focus on different specialty areas, such as the State Key Lab of Clean Energy Utilization, the State Key Lab of Rice Biology and the State Key Lab of Modern Optical Instrumentation.', 120.123439, 30.263608, 'https://www.usnews.com/education/best-global-universities/zhejiang-university-504773');
