INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (153, 'University of Nottingham', 152, 'Nottingham', 'United Kingdom', 'University Park\nNottingham, NG7 2RD\nUnited Kingdom', 'http://www.nottingham.ac.uk/', '', -1.200296, 52.938743, 'https://www.usnews.com/education/best-global-universities/university-of-nottingham-503548');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (154, 'University of Milan', 155, 'Milan', 'Italy', 'Via Festa del Perdono 7 \nMilan, 20122 \nItaly', 'http://www.unimi.it/ENG/ ', 'The University of Milan is a public institution that was founded in 1924. The Italian university’s main campus is situated in a historical complex called Ca’ Granda in the Milan city center. Additional facilities are in the university quarter, or Città Studi, and in a few other locations both in and outside Milan. Tuition costs are the same for Italian and international students but vary based on field of study. A limited amount of university student housing is available for students who come from outside the Milan area.The institution offers studies in a variety of academic areas: agricultural and food sciences; exercise and sports sciences; humanities; law; linguistic and cultural mediation sciences; medicine; pharmacy; political, economic and social sciences; science and technology; and veterinary medicine. In all, the university offers around 65 bachelor\'s programs and a similar number of master\'s programs. The university’s academic calendar is semester-based, though all departments may not have the same start and end dates for their courses. Italian is the primary language of instruction, but the university does offer some English-taught degree programs, most of which are at the graduate level. Examples of programs taught in English include master\'s programs in economics and finance as well as sustainable development. Research centers at the university include the Centre for Gender & Equality in Research and Science and the Centre of Excellence on Neurodegenerative Diseases. The university also has three botanical gardens, one dating back to 1777, that are used for education and research activities.', 9.19466, 45.460063, 'https://www.usnews.com/education/best-global-universities/university-of-milan-506478');
