INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (159, 'Autonomous University of Barcelona', 161, 'Barcelona', 'Spain', 'Plaça Cívica, Campus de la UAB, Bellaterra, Cerdanyola del Vallès\nBarcelona, 08193\nSpain', 'http://www.uab.cat/web/universitat-autonoma-de-barcelona-1345467954774.html', 'The Autonomous University of Barcelona is a public institution that was founded in 1968. The university, also known as UAB, has facilities in and around Barcelona, Spain. The main Bellaterra Campus is located in Cerdanyola del Vallès in the Barcelona metropolitan area. UAB tuition is higher for international students from non-European Union and non-European Economic Area countries. Students can live on campus in apartments at the Vila Universitària, a residential complex that houses more than 2,000 people.UAB has 13 academic divisions: biosciences, sciences, communication studies, education, political science and sociology, law, economics and business studies, engineering, philosophy and arts, medicine, psychology, translation and interpreting, and veterinary medicine. The university is also affiliated with around a dozen independent centers and schools, which grant degrees that are recognized as UAB credentials. The affiliated institutions include the Sant Pau School of Nursing, the School of Tourism and Hotel Management and the Graduate School of Archival and Records Management. The university’s academic calendar is semester-based.The primary languages of instruction are Catalan and Spanish, but several bachelor’s and a number of master’s degree programs are offered in English. The English-taught master’s options include programs in economics and business administration, political science and computer engineering. International students can take one free Catalan language course at the university each academic year. UAB research institutes and centers include the Centre for Prehistoric Archaeological Heritage Studies, the Institute of Educational Sciences and the Institute of Neuroscience.', 2.104486, 41.502647, 'https://www.usnews.com/education/best-global-universities/autonomous-university-of-barcelona-505700');
