INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (169, 'Pompeu Fabra University', 175, 'Barcelona', 'Spain', 'Plaça de la Mercè, 10-12\nBarcelona, 08002\nSpain', 'http://www.upf.edu/en/', 'Pompeu Fabra University, also known as UPF, is a public institution that was founded in 1990. It is located in Barcelona, Spain, and has three campuses – the Cituadella, Poblenou and Mar campuses – located near one another in the heart of the city. The university’s namesake, Pompeu Fabra, is credited with standardizing the modern Catalan language during the late 19th and early 20th centuries. In a recent year, more than 13,000 students attended the university. Some student housing is available near the school\'s campuses, though UPF does not manage it directly.UPF has three broad academic focus areas: social sciences and humanities, health and life sciences, and communications and information technologies. The university is also affiliated with the UPF Group, a collection of specialized teaching and research institutions, including the UPF Barcelona School of Management, the Elisava School of Design and the Mar Nursing School. UPF follows a trimester-based academic calendar. In a recent year, around 20 percent of the UPF faculty was international. Three languages are spoken in UPF classrooms: Catalan, Spanish and English. The primary language of instruction for undergraduates is Catalan, though some subjects are taught in English. Additionally, some graduate-level programs are taught entirely in English, including master\'s programs in political philosophy and biomedical research.The university has numerous research groups, including groups focused on human genetics research, political behavior and wireless communications. UPF is also affiliated with several research centers that are UPF Group members, including the Centre for Regenerative Medicine in Barcelona and the Hospital del Mar Medical Research Institute.', 2.179356, 41.379174, 'https://www.usnews.com/education/best-global-universities/pompeu-fabra-university-504748');
