INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (175, 'Fudan University', 171, 'Shanghai', 'China', '220 Handan Rd. Yangpu District\nShanghai, 200433\nChina', 'http://www.fudan.edu.cn/englishnew/ ', 'Fudan University is a public institution that was founded in 1905. The university is located in Shanghai, China, and is spread across four sites: the Handan, Jiangwan, Fenglin and Zhangjiang campuses. More than 30,000 students are enrolled at Fudan University. Undergraduate students reside on campus in one of five residential colleges – Zhide, Tengfei, Keqing, Renzhong or Xide – for all four years of their studies. Each college is named after a former university leader and has its own dean and student management board. Housing is also available for graduate students.In all, Fudan University offers around 70 undergraduate majors, as well as almost 250 master’s degree programs and some 150 doctoral programs. The undergraduate programs are structured according to a liberal arts core curriculum. The university’s academic calendar is semester-based, and tuition costs are higher for international students. The primary language of instruction is Chinese, but a handful of degree programs are taught in English. In 2000, Fudan University merged with Shanghai Medical University, and the university is affiliated with 11 hospitals. The university has been a major participant in national research for much of its history; research bodies at the university include national key labs for genetic engineering, surface physics and medical neurobiology. Fudan\'s Undergraduate Research Opportunities Program supports around 700 undergraduates\' research work each year. And when students need a break from their studies, they can choose from more than 300 student clubs to participate in, including almost 20 international student groups.', 121.503618, 31.29742, 'https://www.usnews.com/education/best-global-universities/fudan-university-500824');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (176, 'University of Gothenburg', 151, 'Gothenburg', 'Sweden', 'Vasaparken\nGothenburg, SE-405 30\nSweden', 'http://www.gu.se/english', 'The University of Gothenburg is a public institution that was founded in 1954, although the roots of one of its predecessor schools go back as far as 1891. The university has facilities located throughout Gothenburg, Sweden, one of the Scandinavian country\'s largest cities. Students from non-European Union and non-European Economic Area countries pay tuition, while those from EU and EEA countries are exempt. In a recent year, the university\'s international students hailed from around 70 countries. The school only offers student housing to exchange students, but other students can apply for housing through outside organizations such as SGS Studentbostäder, a nonprofit.The university, which follows a semester-based academic calendar, has eight main academic divisions: science; arts; fine, applied and performing arts; social sciences; business, economics and law; education; information technology; and the Sahlgrenska Academy, which is focused on health sciences. The university engages in various collaborations with the nearby , including three shared academic departments and an agreement that enables master\'s students at one school to enroll in courses at the other. The primary language of instruction for undergraduate programs is Swedish, though a number of undergraduate and master\'s courses are taught in English. Fully English-taught degree programs, mostly at the graduate level, are also offered. International students can get a taste of the local language by enrolling in free Swedish courses at the university. Some of the university\'s research facilities include a herbarium, the Sven Lovén Centre for Marine Infrastructure and the Swedish NMR Centre, which is focused on nuclear magnetic resonance spectroscopy.', 11.971878, 57.698172, 'https://www.usnews.com/education/best-global-universities/university-of-gothenburg-501869');
