INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (180, 'Autonomous University of Madrid', 183, 'Madrid', 'Spain', 'Ctra. Colmenar, Km.15, Ciudad Universitaria de Cantoblanco\nMadrid, 28049\nSpain', 'http://www.uam.es/cs/ContentServer/es/home/', 'The Autonomous University of Madrid, also known as UAM, is a public institution that was founded in 1968. The university’s main Cantoblanco campus is in the northern outskirts of Madrid. A medical campus is located a few miles south of the Cantoblanco site, near the La Paz University Hospital, where students can study medicine, nursing, biochemistry, and human nutrition and dietetics. UAM tuition is a bit higher for international students than for domestic students, and some university housing is available for both undergraduate and graduate students.UAM, which uses a semester-based academic calendar, has divisions covering a variety of subjects, including business and economic sciences, law, medicine, philosophy and the arts, psychology, science, and teacher training and education. The university also encompasses the Escuela Politécnica Superior, an engineering school; the La Salle Center of Higher Education; and other affiliated schools. The primary language of instruction is Spanish, though some English-taught courses and degree programs are available. English-taught master\'s offerings include programs in biotechnology and theoretical physics, as well as a program in microfinance for entrepreneurship. Undergraduate degree programs generally last four years, and master\'s programs last a year or longer. Research institutions at the university include several institutes and centers jointly operated with the Spanish National Research Council as well as other Spanish universities, such as the Institute of Mathematical Sciences and the Institute for Theoretical Physics.', -3.694362, 40.546698, 'https://www.usnews.com/education/best-global-universities/autonomous-university-of-madrid-502502');
