INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (194, 'National Taiwan University', 186, 'Taipei', 'Taiwan', 'No. 1, Sec. 4, Roosevelt Road\nTaipei, 10617\nTaiwan', 'http://www.ntu.edu.tw/engv4/', 'National Taiwan University traces its roots back to 1928, when it was originally established as Taihoku Imperial University; it was renamed in 1945. The institution is Taiwan\'s flagship university, and its main campus is located in Taipei, the capital city. The university also has facilities in Yilan, Hsinchu, Yunlin and other areas in central Taiwan. In a recent year, upward of 31,000 students attended the university. Tuition costs are higher for international students and vary by subject, with medical and MBA programs among the most expensive. Some university- and government-funded scholarships are available for foreign students, as is student housing.The university has 11 colleges: bioresources and agriculture, electrical engineering and computer science, engineering, law, liberal arts, life science, management, medicine, public health, social sciences and science. The institution\'s academic calendar is semester-based, and the primary language of instruction is Mandarin, although a number of English-taught courses are available. The university is affiliated with several medical institutions and research centers, including the National Taiwan University Hospital, the NTU Cancer Center and the Drug Research Center. Some of the university\'s other research centers include the International Center of Excellence in Intelligent Robotics and Automation Research, the Population and Gender Studies Center and the Leung Center for Cosmology and Particle Astrophysics. National Taiwan University has exchange agreements with many universities around the world, such as the  in Australia,  in Germany and  in the U.S.', 121.537294, 25.021388, 'https://www.usnews.com/education/best-global-universities/national-taiwan-university-504077');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (195, 'Northeastern University', 200, 'Boston, MA', 'United States', '360 Huntington Avenue\nBoston, Massachusetts 02115\nUnited States', 'http://www.northeastern.edu/', '', -71.0902, 42.3438, 'https://www.usnews.com/education/best-global-universities/northeastern-university-167358');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (196, 'Royal Institute of Technology', 207, 'Stockholm', 'Sweden', 'Brinellvägen 8\nStockholm, SE-100 44\nSweden', 'http://www.kth.se/en', 'The Royal Institute of Technology, also known as KTH, is a public institution that was founded in 1827. The science-, engineering- and technology-focused university’s main campus is located in central Stockholm. Additional sites are the Kista, Haninge, Flemingsberg, Albanova and Södertälje campuses. In a recent year, more than 12,000 full-time students attended the university, 32 percent of whom were women. Students from European Union and European Economic Area countries as well as Switzerland are not charged tuition at KTH; all other students are. Some university student housing is available, and tuition-paying students are guaranteed housing from KTH Accommodation.The university has 10 schools: architecture and the built environment, biotechnology, chemical science and engineering, computer science and communication, electrical engineering, information and communication technology, industrial engineering and management, engineering sciences, technology and health, and education and communication in engineering science. The primary language of instruction for bachelor’s programs is Swedish, though the undergraduate program in information and communication technology is English-taught. Graduate-level programs are primarily taught in English. The academic calendar is made up of two terms, each of which has two periods. Students take exams at the end of each period.KTH has organized its research into five interdisciplinary focus areas: energy, information and communication technology, materials, life science and transport. Research is conducted at the university’s many centers, including the Centre for Banking and Finance, the Centre for Technology in Medicine and Health and the Centre for Autonomous Systems.', 18.073537, 59.347327, 'https://www.usnews.com/education/best-global-universities/royal-institute-of-technology-505970');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (197, 'University of Exeter', 161, 'Exeter, Devon', 'United Kingdom', 'Stocker Road\nExeter, Devon EX4 4PY\nUnited Kingdom', 'http://www.exeter.ac.uk/', '', -3.53329, 50.735841, 'https://www.usnews.com/education/best-global-universities/university-of-exeter-502021');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (198, 'Sungkyunkwan University', 195, 'Seoul', 'South Korea', '25-2, Sungkyunkwan-ro, Jongno-gu\nSeoul, 110-745\nSouth Korea', 'http://www.skku.edu/eng_home/index.jsp', 'Sungkyunkwan University, also known as SKKU, is a private institution that traces its roots back to 1398, when it was founded by royal decree during the Joseon Dynasty. The South Korean university is spread across two campuses – a humanities and social sciences campus in Seoul as well as a natural sciences campus in Suwon, around 28 miles outside of the capital city. Tuition is the same for domestic and international students and varies by academic subject. Scholarships are available for international students, including merit scholarships from SKKU in which the student\'s GPA determines the award amount. University housing for undergraduate and graduate students is available at both campuses.SKKU has academic divisions offering studies in a variety of fields, including Confucian studies and Eastern philosophy, economics and engineering, among many others. The affiliated Sungkyun Language Institute has both English and Korean language programs. SKKU offers more than 30 dual degree programs in partnership with institutions around the world, such as  in China and the  and  in the U.S. The university\'s academic calendar is semester-based, and the primary language of instruction is Korean, though many courses are offered in English. Some degree programs, such as the SKK Graduate School of Business MBA program, are taught fully in English. Among the university\'s research institutes and centers are the Center for East Asian History, the Nano/Bio Fusion Technology Research Center and the Zero Emission Center.', 126.993606, 37.588227, 'https://www.usnews.com/education/best-global-universities/sungkyunkwan-university-500193');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (199, 'Scuola Normale Superiore di Pisa', 204, 'Pisa', 'Italy', 'Piazza dei Cavalieri, 7\nPisa, 56126\nItaly', 'http://www.sns.it/en/ ', 'The Scuola Normale Superiore di Pisa is a public institution that was founded in 1810. The university is located in Pisa, Italy, enrolls just several hundred students and offers free tuition. The university provides students with free housing in several dormitories – Collegio Faedo, Collegio Carducci, Collegio Timpano and Collegio Fermi – as well as a residence for doctoral students in Florence. If there is not space for graduate students in the dormitories, they are given a stipend to pay for outside accommodations. Students at the Scuola Normale can also receive free meals.The university has a handful of academic divisions: humanities, mathematical and natural sciences, and the Institute of Humanities and Social Sciences, which focuses on doctoral studies and is located in Florence. Students enrolled at the institution take courses from both the Scuola Normale and the University of Pisa. After three years of study, students receive a degree from the University of Pisa as well as a specialized diploma from Scuola. After two additional years of study, students can earn a master\'s degree from the University of Pisa and another specialized diploma from Scuola. The primary language of instruction is Italian, and classes are commonly taught in seminar style. The university’s research bodies include the Centre for Data Processing of Texts and Images in the Literary Tradition; the Bio@SNS Laboratory, focused on the study of the brain; and the Laboratory of Sciences of Antiquity.', 10.400105, 43.719465, 'https://www.usnews.com/education/best-global-universities/scuola-normale-superiore-di-pisa-504541');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (200, 'University of Vienna', 200, 'Vienna', 'Austria', 'Universitätsring 1\nVienna, 1010\nAustria', 'http://www.univie.ac.at/en/ ', 'The University of Vienna is a public institution that was founded in 1365, making it the oldest university in the German-speaking world. The Austrian university is located in Vienna, the country\'s capital. The school does not have one central campus but instead has facilities located throughout the city, primarily in the first and ninth districts. Students pay relatively low tuition each semester as well as a small student union fee. The tuition costs are higher for some students from outside the European Union and European Economic Area. The University of Vienna does not operate its own student housing.The university has numerous academic divisions, including those focused on business, economics and statistics; computer science; historical and cultural studies; psychology; and life sciences. Additionally, the university has centers focused on translation studies, sport science, molecular biology and teacher education. In all, the University of Vienna offers around 175 degree programs, including several joint degree programs that provide students the opportunity to study at more than one university. The university follows a semester-based academic calendar, and the primary language of instruction is German. However, a handful of degree programs are taught in English, including master’s programs in communication science, economics and computer science. One of the university\'s research centers is the Vienna Center for Quantum Science and Technology, which is jointly operated with the  and the Austrian Academy of Sciences.', 16.360686, 48.21313, 'https://www.usnews.com/education/best-global-universities/university-of-vienna-505908');
