INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (226, 'Macquarie University', 227, 'North Ryde, New South Wales', 'Australia', 'Balaclava Road\nNorth Ryde, New South Wales 2109\nAustralia', 'http://mq.edu.au/ ', '', 151.11265, -33.773824, 'https://www.usnews.com/education/best-global-universities/macquarie-university-502013');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (227, 'University of Strasbourg', 226, 'Strasbourg', 'France', '4 Rue Blaise Pascal\nStrasbourg, 67081\nFrance', 'http://www.unistra.fr/', 'The Université de Strasbourg traces its roots back to 1538, though it was not until 2009 that three separate universities merged to form the institution as it exists today. The university is a public institution located in the city of Strasbourg in northeastern France, near the country’s border with Germany. In a recent year, more than 46,500 students attended the multicampus institution, and around 36 percent of them pursued bachelor’s degrees. Roughly one-fifth of the total student body was international during that same year. The cost to attend the university is the same for native and international degree-seeking students, and student housing is available through the public organization CROUS.Studies at the university are offered across five broad academic disciplines: arts, literature and languages; law, economics, management, political and social sciences; social sciences and humanities; science and technology; and health. The primary language of instruction is French, but several graduate-level degrees are taught partially in English. The university follows a semester-based academic calendar. The Université de Strasbourg belongs to a network of five universities located in the Upper Rhine Valley called EUCOR. These universities – Strasbourg and the Université de Haute-Alsace in France, the  and the  in Germany and the  in Switzerland – cooperate on joint academic and research programs. Students at these universities can take courses at other EUCOR institutions without having to pay additional fees. Among the Université de Strasbourg’s research units are the Centre for the Analysis of Antique Religious Rhetoric, the Institute of Supramolecular Science and Engineering and the Institute of Cellular and Integrative Neurosciences.', 7.766454, 48.579069, 'https://www.usnews.com/education/best-global-universities/university-of-strasbourg-501292');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (228, 'Trinity College Dublin', 240, 'Dublin 2', 'Ireland', 'College Green\nDublin 2\nIreland', 'https://www.tcd.ie/ ', '', -6.260514, 53.344216, 'https://www.usnews.com/education/best-global-universities/trinity-college-dublin-501570');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (229, 'University of Valencia', 237, 'Valencia', 'Spain', 'Av. Blasco Ibáñez, 13.\nValencia, 46010\nSpain', 'http://www.uv.es/uvweb/college/en/university-valencia-1285845048380.html', 'The University of Valencia is a publicinstitution that was founded in 1499. The university has three campuses in Valencia, Spain, and the surrounding metropolitan area – the Blasco Ibáñez, Burjassot-Paterna and Tarongers campuses. Valencia, a coastal city, is located approximately 220 miles east of Madrid. In a recent year, more than 58,000 students attended the school. Tuition is the same for domestic and international students, and some student housing is available at residence halls owned by or affiliated with the university.The university offers studies in basic and experimental sciences, engineering, health sciences, humanities, education, and social, economic and legal sciences. Several international dual degree programs – in which students spend time studying at a partner university abroad – are offered at the undergraduate level. The primary language of instruction is Spanish, but some bachelor\'s and master\'s degree programs are partially or fully English-taught. Some of the English-taught master\'s offerings include programs in international business management as well as economics. Catalan is also spoken at the institution. The university’s academic calendar is semester-based.The University of Valencia Science Park contains research institutes as well as a business area that is home to more than 70 companies that focus mainly on biotechnology or information and communication technologies. Research Institutes at the science park include the Institute of Materials Science, the Institute of Molecular Science and the Image Processing Laboratory. Another university research facility is the century-old Astronomical Observatory that houses three telescopes and two all-sky cameras.', -0.359386, 39.479325, 'https://www.usnews.com/education/best-global-universities/university-of-valencia-504510');
