INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (231, 'University of Turin', 227, 'Turin', 'Italy', 'Via Verdi, 8\nTurin, 10124\nItaly', 'http://www.unito.it/unitoWAR/page/unito/home_en/P34609334691252602657885 ', 'The University of Turin, sometimes called Unito, is a public institution that was founded in 1404. It is located in Turin, Italy, which was the host city for the 2006 Winter Olympics. Turin is in the Piedmont region of northwest Italy, roughly 90 miles southwest of Milan. The university has seven campuses, five of which are located in the city center. The other two campuses are at the outskirts of the city. Tuition at the university costs the same for Italian and international students. EDISU Piedmont, a public organization, manages the university housing, which is available for both undergrad and graduate students.The university has six schools: agriculture and veterinary medicine; management and economics; medicine; science of nature; law, politics and social-economic sciences; and human sciences. In a recent year, the institution offered more than 65 three-year bachelor\'s programs and 75 two-year master\'s programs. The academic calendar is semester-based, with exceptions for a few programs. The primary language of instruction at the University of Turin is Italian, but a handful of degree programs are taught in English, including a bachelor’s in business management and master’s degree programs in fields such as economics and molecular biotechnology. The institution offers Italian language courses for students, visiting professors and researchers. The university’s many research centers and institutes include the Molecular Biotechnology Center, the Centre for Nanostructured Interfaces and Surfaces and the Interdisciplinary Research Institute on Sustainability.', 7.688901, 45.069428, 'https://www.usnews.com/education/best-global-universities/university-of-turin-502528');
