INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (243, 'Osaka University', 242, 'Suita, Osaka', 'Japan', '1-1 Yamadaoka\nSuita, Osaka 565-0871\nJapan', 'http://www.osaka-u.ac.jp/en', 'Osaka University, sometimes called OU, is a Japanese national university that was founded in 1931 as the sixth imperial university of Japan. It is located in Osaka, Japan, and has three main campuses – Suita, Toyonaka and Minoh. In 2007, the university merged with the Osaka University of Foreign Studies. Upward of 23,000 students attended the institution in a recent year, and around two-thirds of them studied at the undergraduate level. That same year, roughly 9 percent of the student body was international. Tuition costs are the same for domestic and international students, and university housing is available for both undergraduate and graduate students.The research-oriented university has 11 undergraduate schools: human sciences, foreign studies, law, letters, economics, science, medicine, dentistry, pharmaceutical sciences, engineering and engineering science. The university also has more than a dozen graduate schools, including a school of language and culture, school of information science and technology, and a school of frontier biosciences. The institution’s academic calendar is semester-based, and the primary language of instruction for undergraduates is Japanese, though a few English-taught undergraduate degree programs are available. English-language instruction is a bit more common at the graduate level. The university boasts multiple libraries, including a life science library, a science and engineering library and an international studies library. Osaka University\'s research institutes include the Research Institute for Microbial Diseases and the Joining and Welding Research Institute.', 135.524468, 34.822014, 'https://www.usnews.com/education/best-global-universities/osaka-university-505864');
