INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (250, 'Tohoku University', 255, 'Aoba-ku, Sendai, Miyagi', 'Japan', '1-1 Katahira, 2-chome\nAoba-ku, Sendai, Miyagi 980-8577\nJapan', 'http://www.tohoku.ac.jp/english/', 'Tohoku University is a Japanese national university that was founded in 1907. The institution is spread across five sites – the Katahira, Kawauchi, Aobayama, Seiryo and Amamiya campuses – in the city of Sendai, Japan. Sendai is located around 225 miles north of Tokyo. In a recent year, more than 17,000 students attended the university and upward of 60 percent of them studied at the undergraduate level. In the same year, Tohoku University\'s international students hailed from around 90 countries. Tuition costs are the same for domestic and international students, and some university housing is available.Tohoku University has 10 schools for undergraduates: arts and letters, education, law, economics, science, medicine, dentistry, pharmacy and pharmaceutical sciences, engineering and agriculture. The university also has 17 graduate schools and three professional graduate schools in law, public policy and accounting. The university’s academic calendar is semester-based. The primary language of instruction is Japanese, but the university offers three undergraduate degree programs – in molecular chemistry, marine biology, and mechanical and aerospace engineering – and roughly a dozen graduate programs in English. Research institutes at Tohoku University include the Institute for Materials Research, the Research Institute of Electrical Communication and the Institute of Fluid Science. The university also established the Tohoku University Institute for Disaster Reconstruction and Regeneration Research after an earthquake and tsunami severely damaged the school in 2011. Through this institute, the university continues to help affected communities recover from the natural disaster.', 140.874122, 38.253802, 'https://www.usnews.com/education/best-global-universities/tohoku-university-500862');
