INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (273, 'Korea University', 271, 'Seoul', 'South Korea', '145, Anam-ro, Seongbuk-gu\nSeoul, 02841\nSouth Korea', 'http://www.korea.ac.kr/mbshome/mbs/en/index.do', 'Korea University is a private institution that was founded in 1905. Originally called Bosung College, the university received its current name in 1946. The South Korean university has two campuses – one in Seoul and another in Sejong – located about 80 miles from each other. The Seoul campus is the larger of the two; more than three-quarters of the university’s students study there. Tuition is the same for domestic and international students, and some university- and government-sponsored scholarships are available for non-Korean students. University housing is available, and residences for international students include the CJ International House and the Anam Global House. Foreign students can participate in a buddy program and a language partner program to help them better acclimate to life on campus.The university has undergraduate colleges and graduate schools that offer studies in a variety of subjects, including the liberal arts and sciences. It also has professional graduate schools, such as a law school, business school and school of medicine. The university is affiliated with the Ansan, Guro and Anam hospitals. Korean is the primary language of instruction, though some courses are offered in English. The academic divisions that offer the most English-taught courses are the Division of International Studies and the Korea University Business School. The university’s academic calendar is semester-based. Korea University’s research institutes include the KU Biodefense Research Institute, the Brain and Motivation Research Institute and the Research Institute for Information and Communication Technology.', 127.027777, 37.590799, 'https://www.usnews.com/education/best-global-universities/korea-university-505391');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (274, 'Universite Paris Saclay', 274, 'Saint-Aubin', 'France', 'Espace Technologique, Bat. Discovery\nSaint-Aubin, 91190\nFrance', 'https://www.universite-paris-saclay.fr/en', '', 2, 49, 'https://www.usnews.com/education/best-global-universities/universite-paris-saclay-529676');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (275, 'University of Newcastle', 274, 'Callaghan, New South Wales', 'Australia', 'University Drive\nCallaghan, New South Wales 2308\nAustralia', 'http://www.newcastle.edu.au/ ', '', 151.694811, -32.89708, 'https://www.usnews.com/education/best-global-universities/university-of-newcastle-500363');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (276, 'Korea Advanced Institute of Science and Technology', 252, 'Daejeon', 'South Korea', 'Daehak-ro (373-1 Guseong-dong), Yuseong-gu\nDaejeon, 305-701\nSouth Korea', 'http://www.kaist.edu/html/en/index.html', 'The Korea Advanced Institute of Science and Technology, commonly known as KAIST, is a public institution that was founded in 1971. The science and technology-focused university’s main campus – where more than 90 percent of students take classes – is in Daejeon, South Korea. Daejeon is around 85 miles south of the capital city of Seoul. In most cases, tuition costs the same for international and domestic students. Many government- or school-sponsored scholarships are also available for KAIST students, including some that cover tuition and fees in full. The university operates more than 20 student dormitories as well as a few apartment complexes for married students.KAIST has colleges of natural sciences, life science and bioengineering, engineering, liberal arts and convergence science, and business. The university’s academic calendar is semester-based, and the primary language of instruction is English, though some courses are taught in Korean. One of the university’s research facilities is the KAIST Institute, which is made up of five research institutes – KI for BioCentury, KI for Information Technology Convergence, KI for Robotics, KI for NanoCentury and KI for Health Science and Technology – as well as two centers. Around 220 faculty members and 350 students and researchers carry out interdisciplinary research at the KAIST Institute. Undergraduates at the university can earn credit for taking part in research activities through KAIST’s Undergraduate Research Participation Program, which also provides students with financial support. Approximately 200 students participate in the URP program each year.', 127.361369, 36.370373, 'https://www.usnews.com/education/best-global-universities/korea-advanced-institute-of-science-and-technology-506336');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (277, 'University of Münster', 276, 'Münster', 'Germany', 'Schlossplatz 2\nMünster, 48149\nGermany', 'http://www.uni-muenster.de/en/ ', '', 7.612997, 51.963701, 'https://www.usnews.com/education/best-global-universities/university-of-munster-500396');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (278, 'Nagoya University', 290, 'Chikusa-ku, Nagoya, Aichi', 'Japan', 'Furo-cho\nChikusa-ku, Nagoya, Aichi 464-8601\nJapan', 'http://en.nagoya-u.ac.jp/', 'Nagoya University is a Japanese national university that traces its roots back to 1871, when its predecessor medical school was established. In 1939, the institution became the last imperial university of Japan. The university is located in Nagoya – the capital of the Aichi prefecture in Japan. It also has satellite campuses in other countries, including Cambodia, Mongolia and Vietnam, which offer programs for doctoral students. In a recent year, more than 15,500 students attended Nagoya University and more than 60 percent of them studied at the undergraduate level. The same year, roughly 10 percent of the Nagoya student body was international. The university charges domestic and international students the same tuition rates and has several dormitories for international students located on or near campus.Nagoya University has nine schools – letters, education, law, economics, informatics and sciences, medicine, science, engineering and agricultural sciences – as well as more than a dozen graduate schools and several institutes. The primary language of instruction is Japanese, but some undergraduate and graduate-level programs, called Global 30 International Programs, are taught entirely in English. These include undergraduate programs in chemistry and automotive engineering and graduate-level programs in medical science as well as economics and business administration. The university uses a semester-based academic calendar. Some of the university’s research centers and institutes are the Institute of Transformative Bio-Molecules, the Institute of Innovation for Future Society and the Kobayashi-Maskawa Institute for the Origin of Particles and the Universe.', 136.92147, 35.15842, 'https://www.usnews.com/education/best-global-universities/nagoya-university-501944');
