INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (282, 'University of Trieste', 282, 'Trieste', 'Italy', 'Piazzale Europa,1\nTrieste, 34127\nItaly', 'http://www.units.it/ ', 'The University of Trieste is a public institution that traces its roots back to 1877 when it was initially started as the School of Commerce. The institution was officially founded as a university in 1924. Its main campus is in Trieste, Italy, a city located east of Venice and near the country\'s border with Slovenia. The university has other sites in Gorizia, Portogruaro and Pordenone, all in northeastern Italy. Tuition costs vary by academic subject but are the same for domestic and international students. Housing in student residence halls is available through an outside organization.The university\'s 10 main academic divisions cover a variety of subjects: chemical and pharmaceutical sciences; economic, business, mathematical and statistical sciences; engineering and architecture; humanities; legal, language, interpreting and translation studies; life sciences; mathematics and geosciences; medicine, surgery and health sciences; physics; and political and social sciences. The primary language of instruction is Italian. However, program options are available for English speakers, including English-taught bachelor\'s degree programs in business and management, as well as a master\'s program in physics offered jointly with the . For the most part, the university uses a semester-based academic calendar. The city of Trieste and the surrounding area are home to a number of research institutions – including the Elettra Synchrotron Light Laboratory and the AREA Science Park – and the university has partnerships with some of them.', 13.793226, 45.658562, 'https://www.usnews.com/education/best-global-universities/university-of-trieste-500914');
