INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (300, 'Tokyo Institute of Technology', 305, 'Meguro-ku, Tokyo', 'Japan', '2-12-1 Ookayama\nMeguro-ku, Tokyo, 152-8550\nJapan', 'http://www.titech.ac.jp/english/', 'The Tokyo Institute of Technology, also known as Tokyo Tech, is a Japanese national university. The institution traces its roots back to 1881, when it was originally founded as the Tokyo Vocational School. The science- and technology-focused university is spread across three campuses – Ookayama, Suzukakedai and Tamachi. The Ookayama campus, Tokyo Tech\'s main location, is situated in the Meguro City area of Tokyo. In a recent year, more than 9,500 students attended Tokyo Tech. Around half of the school\'s students are undergraduates, while the other half are enrolled in master\'s and doctoral programs. Roughly 12 percent of the total student body is international. Tuition is the same for Japanese and international students, and some university housing is available.Tokyo Tech has six schools: science, engineering, materials and chemical technology, computing, life science and technology, and environment and society. There is also the Institute for Liberal Arts, which offers courses in foreign languages, the humanities and other subjects to supplement students\' science training. The university’s academic calendar is semester-based, and the primary language of instruction is Japanese. Students at all degree levels can get involved with research at Tokyo Tech. During their fourth year, undergraduates conduct research for their bachelor’s degree thesis by joining their academic adviser’s laboratory. More than 90 percent of the university\'s undergraduates go on to pursue graduate-level degrees. Tokyo Tech master’s and doctoral students also become affiliated with laboratories at the university. Some of the university\'s labs are the Chemical Resources Laboratory, the Precision and Intelligence Laboratory and the Research Laboratory for Nuclear Reactors.', 139.682784, 35.604224, 'https://www.usnews.com/education/best-global-universities/tokyo-institute-of-technology-504950');
