INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (322, 'University of Innsbruck', 319, 'Innsbruck', 'Austria', 'Innrain 52\nInnsbruck, 6020\nAustria', 'http://www.uibk.ac.at/index.html.en ', 'The University of Innsbruck is a public institution that was founded in 1669. The university is located in Innsbruck, Austria, in the Alps region. The institution has four main campuses – Innrain, Sport, Technik and Universitätsstraße. In a recent year, around 40 percent of the University of Innsbruck student body was international. Students from European Union and European Economic Area countries are not charged tuition, but students from outside these areas pay relatively low tuition costs. The university does not offer its own student housing.The university has 16 main academic divisions that cover a variety of fields, including biology, economics and statistics, engineering science, management, and political science and sociology. Overall, the institution offers more than 100 different academic programs. The university used to have medical division, but in 2004 it became its own institution: the . The university\'s primary language of instruction is German, but some English-taught programs are available, including master\'s programs in applied economics, physics and strategic management. The university follows a semester-based academic calendar.The main research areas at the University of Innsbruck are alpine space – man and environment, cultural encounters – cultural conflicts, molecular biosciences, physics and scientific computing. Some of the research centers at the University of Innsbruck are focused on Alpine infrastructure engineering, mountain agriculture, and migration and globalization. The university also has a botanical garden that is used for teaching and research; the garden was created in 1793 and is home to thousands of plant species.', 11.383801, 47.263354, 'https://www.usnews.com/education/best-global-universities/university-of-innsbruck-504813');
INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (323, 'Ivane Javakhishvili Tbilisi State University', 322, 'Tbilisi', 'Georgia', '1, Chavchavdze Ave.\nTbilisi, 0179\nGeorgia', 'https://www.tsu.ge/en/', 'Ivane Javakhishvili Tbilisi State University was omitted in the original publication of the 2020 Best Global Universities rankings, but is now included as a ranked institution in the overall rankings, and was incorrectly ranked at No. 403 in Physics at the initial publication of the 2020 edition of Best Global Universities which has now been corrected. See the  blog for an update made to the 2020 Best Global Universities rankings.', 44.722, 41.7171, 'https://www.usnews.com/education/best-global-universities/ivane-javakhishvili-tbilisi-state-university-528844');
