INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (330, 'Pohang University of Science and Technology', 335, 'Pohang, Gyeongbuk', 'South Korea', '77 Cheongam-Ro. Nam-Gu\nPohang, Gyeongbuk 790-784\nSouth Korea', 'http://www.postech.ac.kr/', 'Pohang University of Science and Technology, also known as POSTECH, is a private institution that was founded in 1986. The science- and engineering-focused university is located in the city of Pohang, South Korea, approximately 250 miles southeast of the capital city, Seoul. In a recent year, upward of 3,000 students attended the university and approximately 40 percent of them studied at the undergraduate level. Tuition is the same for international and domestic students, and many POSTECH students receive university or government scholarships and grants. Additionally, new international graduate students at POSTECH receive a settlement allowance during their first semester to help cover relocation expenses. University student housing is available for both undergraduate- and graduate-level students.The university has academic divisions that focus mainly on science, engineering and technology. Both Korean and English are spoken in POSTECH classrooms. In a recent year, around 85 percent of courses that counted toward undergraduate and graduate majors were offered in English. However, if students want to brush up on their Korean language skills, they can take classes through the POSTECH Korean Language Program. The university follows a semester-based academic calendar, with the school year beginning in March. One of the university’s research facilities is the Pohang Accelerator Laboratory, the only synchrotron radiation accelerator in South Korea. POSTECH\'s Undergraduate Research Program provides funding for 40-60 students each year to participate in research activities for several months under faculty guidance. Undergraduates can also enroll in research-focused courses for academic credit.', 129.322545, 36.013968, 'https://www.usnews.com/education/best-global-universities/pohang-university-of-science-and-technology-503003');
