INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (336, 'Yonsei University', 329, 'Seoul', 'South Korea', '50 Yonsei-ro, Seodaemun-gu\nSeoul, 120-749\nSouth Korea', 'http://www.yonsei.ac.kr/eng/', 'Yonsei University is a private institution that traces its roots back to 1885, when Christian missionaries founded a hospital that eventually became part of the university. The university as it currently exists was created in 1957. The South Korean school has multiple campuses, with the Sinchon campus in Seoul as its main location. Other locations include the International Campus in Songdo, which opened in 2010, and the Wonju Campus. Tuition costs at Yonsei are the same for domestic and international students and vary by academic subject. University housing is available for both undergraduate and graduate students. Yonsei freshmen spend their first year on the International Campus and participate in the university\'s residential college system, in which students become members of one of 12 houses that offer educational and social activities.The university has numerous academic divisions, including colleges of liberal arts, business and economics, science, engineering and theology, among others. The primary language of instruction at Yonsei is Korean, but some English-taught degree programs are offered. For instance, programs at the university’s Underwood International College, a liberal arts institution, are entirely English-taught, as are the programs at the Graduate School of International Studies. Another English-taught offering is the Yonsei Global MBA program. The university has a semester-based academic calendar. University research institutes include the Institute of Convergence Science, the Institute for Poverty Alleviation and International Development and the Institute of Korean Studies.', 126.938572, 37.565784, 'https://www.usnews.com/education/best-global-universities/yonsei-university-503801');
