INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (359, 'National Tsing Hua University', 358, 'Hsinchu', 'Taiwan', 'No. 101, Section 2, Kuang-Fu Road\nHsinchu, 30013\nTaiwan', 'http://www.nthu.edu.tw/english/', 'National Tsing Hua University is a public institution that traces its roots back to 1911, when it was established in Beijing as Tsing Hua Academy. The school was renamed in 1928 and then relocated to its present site in Hsinchu, Taiwan – around 50 miles southwest of Taipei – in 1956. Tuition costs at the university are the same for domestic and international students, though they vary by subject, with science and engineering degree programs costing more. The university, government agencies and private organizations provide some scholarships for international students. University housing is available, with priority given to foreign students; many faculty members also live on campus.The university has several colleges – science, engineering, electrical engineering and computer science, humanities and social sciences, life science, nuclear science and technology management –  and its academic calendar is semester-based. The primary language of instruction is Mandarin, though some of the university\'s courses are offered in English. A few fully English-taught degree options, including an international MBA in technology management, are also available. Some of National Tsing Hua University\'s research centers are the Nuclear Science and Technology Development Center; the Center for Science, Technology and Society; and the Center for Energy and Environmental Research. The university has agreements for research, exchange and other joint activities with more than 100 universities around the world, such as  in China,  in Japan and the  in the U.S.', 120.993232, 24.794725, 'https://www.usnews.com/education/best-global-universities/national-tsing-hua-university-501245');
