INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (513, 'Indian Institute of Technology Bombay', 513, 'Mumbai, Maharashtra', 'India', 'IIT Bombay, Powai\nMumbai, Maharashtra 400076\nIndia', 'http://www.iitb.ac.in/ ', 'The Indian Institute of Technology Bombay, also known as IIT Bombay, is a public institution that was founded in 1958. The university is located in Powai, a northern suburb of Mumbai, India, and its campus sits between the Powai and Vihar lakes. It takes about an hour to travel by public transportation from the IIT Bombay campus to the Mumbai city center. In a recent year, less than 1 percent of the university’s student body was international. Tuition costs are higher for foreign students. IIT Bombay is a residential institution where all students, as well as many faculty members, live on campus. Housing is guaranteed for all students.The science- and technology-focused school has many academic divisions, including departments focused on aerospace, chemical, civil, electrical and mechanical engineering. The primary language of instruction at IIT Bombay is English, and the institution’s academic calendar is semester-based. Undergraduates get involved with research at IIT Bombay through the UG Research Awards program, where they can receive stipends to conduct research and earn academic credit for their work. University research centers include the Centre for Research in Nanotechnology and Science, the Centre for Technology Alternatives for Rural Areas and the Centre for Formal Design and Verification of Software. The university has numerous partnerships with institutions in around two dozen countries for student exchanges, joint degree programs and collaborative research work. Examples of these partnerships include a joint doctoral program offered with  in Australia and another offered with the .', 72.91623, 19.131921, 'https://www.usnews.com/education/best-global-universities/indian-institute-of-technology-bombay-501259');
