INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (529, 'Indian Institute of Science', 530, 'Bangalore', 'India', 'CV Raman Road, M S Ramaiah Nagar\nBangalore, 560012\nIndia', 'http://www.iisc.ernet.in/ ', 'The Indian Institute of Science is a public institution that was founded in 1909. The university is located in the city of Bangalore in southern India. In a recent year, upward of 3,000 students attended the university, and the vast majority of them – 89 percent – studied at the graduate level. The school\'s relatively new undergraduate program is research-focused. The first class of bachelor’s students graduated from the school in 2015. International students cannot enroll in the undergraduate program, but they can apply to the university\'s graduate-level programs. However, in a recent year, less than 1 percent of the student body was international. The Indian Institute of Science is a residential school – nearly all of its undergraduate- and graduate-level students live in on-campus student housing.The science- and engineering-focused institution has six academic divisions, each with multiple departments: biological sciences, chemical sciences, electrical sciences, interdisciplinary research, mechanical sciences, and physical and mathematical sciences. The university uses a semester-based academic calendar, and the language of instruction at all levels of study is English. Tuition is the same for domestic and international students. All students at the university receive stipends that cover some or all of their tuition and living costs. Federal government grants fund many of these stipends. Among the university’s research centers are the Center for Infrastructure, Sustainable Transportation and Urban Planning, the Divecha Centre for Climate Change and the Centre for Brain Research.', 77.56921, 13.023764, 'https://www.usnews.com/education/best-global-universities/indian-institute-of-science-505956');
