INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (600, 'National Cheng Kung University', 605, 'Tainan City', 'Taiwan', 'No.1, University Road\nTainan City, 701\nTaiwan', 'http://web.ncku.edu.tw/bin/home.php?Lang=en', 'National Cheng Kung University is a public institution that was established in 1931 as Tainan Technical College. The university is located in the city of Tainan, in southwest Taiwan, and received its current name in 1971. It has 11 campuses, eight of which are adjacent to each other and collectively form the main campus area. In a recent year, upward of 21,000 students attended National Cheng Kung University, and a little more than half of them studied at the undergraduate level. Tuition costs vary by subject and are higher for international students, who can apply for university- and government-sponsored scholarships. Housing is available for both undergraduate and graduate students.The university has colleges focused on a variety of subjects: liberal arts, sciences, engineering, electrical engineering and computer science, planning and design, management, social science, medicine, and bioscience and biotechnology. Its academic calendar is semester-based, and the primary language of instruction is Chinese. However, some classes and a handful of degree programs – mostly at the graduate level – are taught in English. Degree-seeking international students can also take free Chinese language courses. National Cheng Kung University\'s research centers include the University Center for Bioscience and Biotechnology, the Research Center for Energy Technology and Strategy, and the Medical Device Innovation Center. University researchers were involved in the construction of the Formosat-2 satellite, which launched in 2004 and carried the National Cheng Kung University flag into outer space.', 120.216068, 22.998361, 'https://www.usnews.com/education/best-global-universities/national-cheng-kung-university-502356');
