INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (745, 'National Chiao Tung University', 719, 'Hsinchu', 'Taiwan', '1001 University Road\nHsinchu, 300\nTaiwan', 'http://www.nctu.edu.tw/english/', 'National Chiao Tung University traces its roots back to 1896, when it was founded in Shanghai, as Nanyang College. The university was re-established in 1958 in Hsinchu, Taiwan, and it adopted its current name in 1979. The university has five campuses. Its main location – the Kuang-Fu campus – is located near the Hsinchu Science Park, which is aimed at developing the region\'s tech industry. Several national research centers and laboratories are also located near the main campus. In a recent year, more than 12,000 students attended the research-oriented university and upward of 55 percent of them studied at the graduate level. Tuition costs are higher for international students, but they can apply for some scholarships. University housing is available for both undergraduate and graduate students.The university, which follows a semester-based academic calendar, has many colleges: science, electrical and computer engineering, computer science, engineering, management, humanities and social sciences, biological science and technology, Hakka studies, photonics, law, and the International College of Semiconductor Technology. The primary language of instruction is Chinese, though some courses and graduate-level programs are taught in English. Among the English-taught degree options are a global MBA program and an international doctoral program in photonics. International students can also take free Chinese language courses. Some of the university\'s research centers are the Brain Research Center, the Nanoelectronics and Infotronic Systems Research Center, and the Disaster Prevention and Water Environment Research Center.', 120.996735, 24.785915, 'https://www.usnews.com/education/best-global-universities/national-chiao-tung-university-502912');
