INSERT INTO `universitylist_university`(`id`, `name`, `latest_rank`, `city`, `country`, `address`, `website`, `summary`, `longitude`, `latitude`, `date_url`) VALUES (877, 'Indian Institute of Technology Madras', 654, 'Chennai, Tamil Nadu', 'India', 'Sardar Patel Road\nChennai, Tamil Nadu, 600036\nIndia', 'https://www.iitm.ac.in/', 'The Indian Institute of Technology Madras, also known as IIT Madras, is a public institution that was founded in 1959 with technical support from the German government. The university is located in Chennai, a coastal city and the capital of Tamil Nadu in southern India. In a recent year, more than 8,000 students attended the university. Most of the international students at IIT Madras are visiting the campus as part of short-term study abroad programs or to conduct research. IIT Madras is a residential school – nearly all of the institute\'s students live on campus, as do many faculty members.IIT Madras has more than a dozen academic departments, many of which offer studies in different types of engineering, including aerospace, chemical, civil, electrical, mechanical and ocean engineering. Several departments also focus on other scientific fields – math, physics and chemistry – and the humanities. IIT Madras students can enroll in bachelor\'s, master\'s or doctoral degree programs, as well as dual-degree programs. The university uses a semester-based academic calendar, and English is the language of instruction. Research centers at the university include the Indo-German Centre for Sustainability, the Centre for Nanotechnology and the National Center for Catalysis Research. The IIT Madras Research Park helps companies gain access to university research and insights. Businesses can set up shop in the research park and work with IIT Madras on research and development projects.', 80.2336, 12.9915, 'https://www.usnews.com/education/best-global-universities/indian-institute-of-technology-madras-502278');
